INSERT INTO `product_translations` VALUES (1,1,'en','Apple MacBook Pro 2019 Model (13-Inch, Intel Core i5, 1.4Ghz, 8GB, 128GB)','<div id=\"dpx-product-description_feature_div\">\r\n<div id=\"descriptionAndDetails\" class=\"a-section a-spacing-extra-large\">\r\n<div id=\"productDescription_feature_div\" class=\"celwidget\" data-feature-name=\"productDescription\" data-cel-widget=\"productDescription_feature_div\">\r\n<div id=\"productDescription_feature_div\" class=\"a-row feature\" data-feature-name=\"productDescription\" data-template-name=\"productDescription\" data-cel-widget=\"productDescription_feature_div\">\r\n<div id=\"productDescription\" class=\"a-section a-spacing-small\">\r\n<h1 style=\"text-align: center;\">Apple MacBook Pro 2019</h1>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/N6nId5NOP7e9GODBWgtTRADWF0g54vNEneySdJzJ.jpeg\" alt=\"\" width=\"1500\" height=\"1747\" /></p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/XbP2OOs5f6Ouz7SFojXIsDocK7voYCMZLoLoMvo4.jpeg\" alt=\"\" width=\"1500\" height=\"1748\" /></p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/uJWTTFHG93018uuCqxjzFm6tXLE9PRxFi28nbZ6u.jpeg\" alt=\"\" width=\"1500\" height=\"1747\" /></p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/HfxUy8r6ncbEJ9GZ6znsMxFlN61kvSvzboYEH5OS.jpeg\" alt=\"\" width=\"1500\" height=\"1747\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h4>Product Details:</h4>\r\n<p>A touch of genius. The Apple 13.3\" MacBook Pro with Touch Bar is faster and more powerful than before, yet remarkably thinner and lighter. It has the brightest, most colorful Mac notebook display ever. And it introduces the Touch Bar - a Multi-Touch enabled strip of glass built into the keyboard for instant access to tools you want, right when you want them. The new MacBook Pro is built on groundbreaking ideas. And it\'s ready for yours.</p>\r\n<p><strong>Thunderbolt 3 Compatible</strong></p>\r\n<p>The Thunderbolt 3 is a revolutionary USB-C cable that can be used to transfer 4K video in seconds, connect your laptop to a TV screen or other device, or provide power and charge your laptop faster than ever before. The Apple MacBook Pro has four Thunderbolt 3 ports so you can take advantage of this lightening fast, high pixel connection.</p>\r\n<p><strong>Sleek and Stylish</strong></p>\r\n<p>The MacBook Pro has a thin body that is easily transported in a backpack or briefcase. The space gray finish is stylish and durable, and features like the ergonomic keyboard and large glass trackpad make it easy to use. The High Sierra operating system is intuitive and features a practical array of apps including iCloud.</p>\r\n<p><strong>Touch Bar with Touch ID</strong></p>\r\n<p>The Apple 256GB MacBook Pro includes a touch sensitive LED bar instead of the function keys at the top of the keyboard. This bar displays options that work best with the app you are currently using and don\'t require the memorization needed to keep track of the uses of each function key. Touch ID is integrated into this Apple laptop\'s power button and can be used to authorize purchases in Apple Pay. The Touch ID accurately scans your fingerprint so it can match it with the Secure Enclave in the laptop\'s Apple T2 co-processor chip. Make payments with ease and peace of mind knowing that Touch ID technology operates with the highest degree of precision.</p>\r\n<h4>&nbsp;</h4>\r\n<h4>Technical Details:</h4>\r\n<table id=\"productDetails_techSpec_section_1\" class=\"a-keyvalue prodDetTable\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Screen Size</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">13.3 inches</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Screen Resolution</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">2560 x 1600</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Processor</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">3.1 GHz core_i5</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">RAM</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">8 GB LPDDR3</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Memory Speed</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">2133 GHz</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Hard Drive</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">256 GB 256GB PCIe SSD</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Graphics Coprocessor</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">NVIDIA GeForce 320M</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Chipset Brand</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">Intel</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Wireless Type</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">802.11b</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<br />\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div id=\"dpx-btf-renewed-program-description_feature_div\">\r\n<div id=\"renewedProgramDescriptionBtf_feature_div\" class=\"celwidget\" data-feature-name=\"renewedProgramDescriptionBtf\" data-cel-widget=\"renewedProgramDescriptionBtf_feature_div\"></div>\r\n</div>','Ninth-generation 6-Core Intel Core i7 Processor\r\nStunning 16-inch Retina Display with True Tone technology\r\nTouch Bar and Touch ID\r\nAmd Radeon Pro 5300M Graphics with GDDR6 memory'),(2,2,'en','Oneplus 7 Pro GM1910 256GB, 8GB, Dual Sim, 6.67 inch, 48MP Main Lens Triple Camera','<p>Oneplus 7 Pro GM1910 (China Model), DispIay Size: 6.67\", QHD+ AMOLED | ResoIution: 1440 x 3120 pixeIs | Type: AMOLED | Cover Glass: 3D Corning Gorilla, Triple Rear Camera: 48MP Main + 16MP Ultra Wide Angle + 8MP Telephoto . Memory: 256GB+8GB, Dual LED Flash, Video: 4K resolution at 30/60 fps | 1080p resolution at 30/60 fps | Super Slow Motion: 1080p videos at 240 fps | 720p video at 480 fps, Time-Lapse, Video Editor. Pop-up front camera: 16MP.<br />UnIocked ceII phones are compatible with GSM carrier such as AT&amp;T and T-Mobile, but are not compatible with CDMA carriers such as Verizon and Sprint.<br />PIease check if your GSM ceIIular carrier supports the bands for this model before purchasing, LTE may not be available in all areas: FDD LTE: Band B1/2/3/4/5/7/8/12/13/17/18/19/20/25/26/28/29/30/66/71, TDD-LTE: Band B34/38/39/41/46/48, UMTS(WCDMA): Band B1/2/4/5/8/9/19, CDMA: BC0/BC1, GSM: 850/900/1800/1900 MHz.<br />This device may not incIude a US warranty as some manufacturers do not honor warranties for internationaI items. PIease contact the seller for specific warranty information.<br />The box contains: Your new device, USB cabIe, Charger, CIear Case, Documentation.</p>','Oneplus 7 Pro GM1910 (China Model), DispIay Size: 6.67\", QHD+ AMOLED | ResoIution: 1440 x 3120 pixeIs | Type: AMOLED | Cover Glass: 3D Corning Gorilla, Triple Rear Camera: 48MP Main + 16MP Ultra Wide Angle + 8MP Telephoto . Memory: 256GB+8GB, Dual LED Flash'),(3,3,'en','HP Spectre x360 2-in-1 15.6\" 4K Ultra HD Touch-Screen Laptop, Intel i7 8th Gen','<p><span class=\"a-list-item\">LATEST 8TH GENERATION CPU: Intel Core i7-8500</span></p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-list-item\">UNMATCHED PERFORMANCE:16 GB DDR4-2133 SDRAM (2 x 8 GB) of system memory for intense multitasking and gaming, smoothly run your graphics-heavy PC games and video-editing</span></p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-list-item\">SUPERIOR SPEED and Advanced Wireless connectivity: Fast Data Access with 512GB solid state drive PCIe NVMe 4x3 Lane, a flash-based SSD with no moving parts, resulting in faster start-up times data access. Advanced Wireless Connectivity: Intel 802.11ac (2x2) Wi-Fi and Bluetooth 4.2 Combo</span></p>\r\n<p>&nbsp;</p>\r\n<p><strong><span style=\"text-decoration: underline;\"><span class=\"a-list-item\">Specification:</span></span></strong></p>\r\n<table id=\"productDetails_techSpec_section_1\" class=\"a-keyvalue prodDetTable\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Screen Size</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">15.6 inches</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Screen Resolution</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">3840 x 2160</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Max Screen Resolution</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">3840 x 2160</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Processor</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">1.8 GHz Intel Core i7</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">RAM</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">16 GB DDR</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Memory Speed</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">2400 MHz</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Hard Drive</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">512 GB SSD</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Graphics Coprocessor</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">NVIDIA GeForce MX150</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Chipset Brand</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">NVIDIA</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Card Description</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">Dedicated</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Graphics Card Ram Size</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">2 GB</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Wireless Type</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">802.11ac</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Average Battery Life (in hours)</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">13 hours</td>\r\n</tr>\r\n</tbody>\r\n</table>','LATEST 8TH GENERATION CPU: Intel Core i7-8500\r\nUNMATCHED PERFORMANCE:16 GB DDR4-2133 SDRAM (2 x 8 GB) of system memory for intense multitasking and gaming, smoothly run your graphics-heavy PC games and video-editing'),(4,4,'en','Dell XPS 13 9380, 13.3\" 4K UHD (3840X2160) Multi-Touch IPS Display, Intel Core i7-8565U','<p><span class=\"a-list-item\">World\'s smallest 13-inch laptop; The smaller, thinner, lighter 4K Ultra HD XPS 13 is ready for take-off and also Star performances with the new 8th Gen Intel Core processors, more Cores mean increased perfo