alaxy S20 (SM-G980F/DS) Dual SIM 128GB, 6.2\" (International Version)','<p><span class=\"a-list-item\">More camera, more power, more fun &ndash; in a slim, balanced form. Create anywhere on the sleek, powerful Galaxy S20 5G with an expansive 6. 2&rdquo; Infinity-O display and radical new 30x Space Zoom. Galaxy S20 5G&rsquo;s modern design gives you an immersive, cinema-quality experience with next-level functionality. Take pro-quality, hi-res images and video with a groundbreaking 64MP camera and full system of studio lenses with super stabilization. Features like the Single Take AI make it quick and easy to capture multiple photos and video with a single tap. Zoom in close, even from 100 feet away, and capture crisp images at night, even without flash, with Bright Night mode. Share your content in real time with double-tap sharing and get hours of power from minutes of charge with Super Fast Charging. Galaxy S20 5G&rsquo;s intelligent battery lasts all day to power every scroll, click, call, tap, playlist and season finale. Do more of what you love with the device that gives you more. Note: Samsung Galaxy S20 5G does not operate on the Verizon 5G mmW network. It will operate on the Verizon 4G LTE network. See carriers for details.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-list-item\">Power of 5G: Get next-level power for everything you love to do with Samsung Galaxy 5G; Share more, game harder, experience more and never miss a beat</span></p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-list-item\">Single Take AI: Capture video and multiple types of images with one tap of the shutter button; Lenses, effects and filters capture the best of every moment, every time</span></p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-list-item\">Hi-Res Camera Zoom: Capture hi-res images as if you&rsquo;re 3 feet away, from 100 feet away; Whether you want to zoom in close from afar or magnify details nearby, the new 30x Space Zoom gives you impressive power and clarity</span></p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-list-item\">Bright Night Mode: Capture crisp images and vibrant video in Bright Night mode and create high-quality content in low light &ndash; no flash needed</span></p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-list-item\">Super Fast Charging: Charge up quicker with Super Fast Charge so you can keep moving with more juice; Give your buds &ndash; or Galaxy buds &ndash; a boost of power with Wireless PowerShare right from Galaxy S20 5G</span></p>\r\n<p><span class=\"a-list-item\">All-Day Battery: Galaxy S20 5G&rsquo;s intelligent battery uses an algorithm to learn from how you live to optimize power and take you through a day or more of work and life without ever giving out on you</span></p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-list-item\">Massive Storage: Generous storage out of the box and expandable memory means you never have to delete what&rsquo;s important to you; Memory card sold separately</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"text-decoration: underline;\"><strong><span class=\"a-list-item\">Product Details:</span></strong></span></p>\r\n<p>&nbsp;</p>\r\n<table id=\"productDetails_detailBullets_sections1\" class=\"a-keyvalue prodDetTable\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\"><strong>Product Dimensions</strong></th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">6.7 x 3.4 x 2.4 inches</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\"><strong>Item Weight</strong></th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">5.8 ounces</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\"><strong>Shipping Weight</strong></th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">15.2 ounces</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\