ce activated with the Simple Mobile plan of your choice.</span></p>\r\n<p><span class=\"a-list-item\">6.5-inch Super Retina display (OLED) with HDR</span></p>\r\n<p><span class=\"a-list-item\">IP68 dust and water resistant (maximum depth of 2 meters up to 30 minutes)</span></p>\r\n<p><span class=\"a-list-item\">12MP dual cameras with dual OIS and 7MP TrueDepth front camera&mdash;Portrait mode, Portrait Lighting, Depth Control, and Smart HDR</span></p>\r\n<p><span class=\"a-list-item\">Face ID for secure authentication and Apple Pay</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<div class=\"a-row a-expander-container a-expander-inline-container\" aria-live=\"polite\">\r\n<div class=\"a-expander-content a-expander-extend-content a-expander-content-expanded\" aria-expanded=\"true\">\r\n<p><span class=\"a-list-item\">A12 Bionic with next-generation Neural Engine</span></p>\r\n<p><span class=\"a-list-item\">Wireless charging&mdash;works with Qi chargers</span></p>\r\n<p><span class=\"a-list-item\">iOS 12 with Memoji, Screen Time, Siri Shortcuts, and Group FaceTime</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"text-decoration: underline;\"><strong><span class=\"a-list-item\">Specifications:</span></strong></span></p>\r\n<div class=\"a-column a-span6\">\r\n<table id=\"tech-specs-table-left\" class=\"a-bordered tech-spec-theme\">\r\n<tbody>\r\n<tr>\r\n<td class=\"a-text-bold\" style=\"text-align: left;\">\r\n<p>Display</p>\r\n</td>\r\n<td style=\"text-align: right;\">\r\n<p>6.5-inch Super Retina HD display with HDR and True Tone</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td class=\"a-text-bold\" style=\"text-align: left;\">\r\n<p>Capacity</p>\r\n</td>\r\n<td style=\"text-align: right;\">\r\n<p>64GB, 256GB, 512GB</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td class=\"a-text-bold\" style=\"text-align: left;\">\r\n<p>Splash, Water, and Dust Resistant</p>\r\n</td>\r\n<td style=\"text-align: right;\">\r\n<p>All-glass and stainless steel design, water and dust resistant (rated IP68)</p>\r\n</td