class=\"a-span5 a-size-base\" style=\"text-align: left;\">Case material</th>\r\n<td class=\"a-span7 a-size-base\" style=\"text-align: right;\">Stainless steel</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-span5 a-size-base\" style=\"text-align: left;\">Case diameter</th>\r\n<td class=\"a-span7 a-size-base\" style=\"text-align: right;\">40 millimeters</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-span5 a-size-base\" style=\"text-align: left;\">Case Thickness</th>\r\n<td class=\"a-span7 a-size-base\" style=\"text-align: right;\">8 millimeters</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-span5 a-size-base\" style=\"text-align: left;\">Band Material</th>\r\n<td class=\"a-span7 a-size-base\" style=\"text-align: right;\">Silicone</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-span5 a-size-base\" style=\"text-align: left;\">Band length</th>\r\n<td class=\"a-span7 a-size-base\" style=\"text-align: right;\">Women\'s Standard</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-span5 a-size-base\" style=\"text-align: left;\">Band width</th>\r\n<td class=\"a-span7 a-size-base\" style=\"text-align: right;\">18 millimeters</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-span5 a-size-base\" style=\"text-align: left;\">Band Color</th>\r\n<td class=\"a-span7 a-size-base\" style=\"text-align: right;\">Gray</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-span5 a-size-base\" style=\"text-align: left;\">Dial color</th>\r\n<td class=\"a-span7 a-size-base\" style=\"text-align: right;\">Black</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-span5 a-size-base\" style=\"text-align: left;\">Bezel material</th>\r\n<td class=\"a-span7 a-size-base\" style=\"text-align: right;\">Stainless steel</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-span5 a-size-base\" style=\"text-align: left;\"><span class=\"a-declarative\" data-action=\"a-popover\" data-a-popover=\"{&quot;cache&quot;:&quot;true&quot;,&quot;name&quot;:&quot;Bezel function&quot;,&quot;width&quot;:&quot;500&quot;,&quot;header&quot;:&quot;Bezel function&quot;,&quot;position&quot;:&quot;triggerRight&quot;,&quot;scrollable&quot;:&quot;true&quot;,&quot;url&quot;:&quot;/gp/product/ajax-handlers/tech-spec-popover-contents.html/ref=dp_soft_tech_spec?keyLookUp=watch_help_attr-name_bezel_function&quot;}\"><a class=\"a-link-normal a-popover-trigger\" href=\"https://www.amazon.com/gp/product/ajax-handlers/tech-spec-popover-contents.html/ref=dp_soft_tech_spec?keyLookUp=/gp/product/ajax-handlers/tech-spec-popover-contents.html/ref=dp_soft_tech_spec?keyLookUp=watch_help_attr-name_bezel_function\" target=\"_blank\" rel=\"noopener\">Bezel function</a></span></th>\r\n<td class=\"a-span7 a-size-base\" style=\"text-align: right;\">Stationary</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-span5 a-size-base\" style=\"text-align: left;\"><span class=\"a-declarative\" data-action=\"a-popover\" data-a-popover=\"{&quot;cache&quot;:&quot;true&quot;,&quot;name&quot;:&quot;Calendar&quot;,&quot;width&quot;:&quot;500&quot;,&quot;header&quot;:&quot;Calendar&quot;,&quot;position&quot;:&quot;triggerRight&quot;,&quot;scrollable&quot;:&quot;true&quot;,&quot;url&quot;:&quot;/gp/product/ajax-handlers/tech-spec-popover-contents.html/ref=dp_soft_tech_spec?keyLookUp=watch_help_attr-name_calendar_type&quot;}\"><a class=\"a-link-normal a-popover-trigger\" href=\"https://www.amazon.com/gp/product/ajax-handlers/tech-spec-popover-contents.html/ref=dp_soft_tech_spec?keyLookUp=/gp/product/ajax-handlers/tech-spec-popover-contents.html/ref=dp_soft_tech_spec?keyLookUp=watch_help_attr-name_calendar_type\" target=\"_blank\" rel=\"noopener\">Calendar</a></span></th>\r\n<td class=\"a-span7 a-size-base\" style=\"text-align: right;\">Day-Date-Month</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-span5 a-size-base\" style=\"text-align: left;\">Item weight</th>\r\n<td class=\"a-span7 a-size-base\" style=\"text-align: right;\">8.8 Ounces</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-span5 a-size-base\" style=\"text-align: left;\"><span class=\"a-declarative\" data-action=\"a-popover\" data-a-popover=\"{&quot;cache&quot;:&quot;true&quot;,&quot;name&quot;:&quot;Movement&quot;,&quot;width&quot;:&quot;500&quot;,&quot;header&quot;:&quot;Movement&quot;,&quot;position&quot;:&quot;triggerRight&quot;,&quot;scrollable&quot;:&quot;true&quot;,&quot;url&quot;:&quot;/gp/product/ajax-handlers/tech-spec-popover-contents.html/ref=dp_soft_tech_spec?keyLookUp=watch_help_attr-name_watch_movement_type&quot;}\"><a class=\"a-link-normal a-popover-trigger\" href=\"https://www.amazon.com/gp/product/ajax-handlers/tech-spec-popover-contents.html/ref=dp_soft_tech_spec?keyLookUp=/gp/product/ajax-handlers/tech-spec-popover-contents.html/ref=dp_soft_tech_spec?keyLookUp=watch_help_attr-name_watch_movement_type\" target=\"_blank\" rel=\"noopener\">Movement</a></span></th>\r\n<td class=\"a-span7 a-size-base\" style=\"text-align: right;\">Touchscreen</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-span5 a-size-base\" style=\"text-align: left;\">Water resistant depth</th>\r\n<td class=\"a-span7 a-size-base\" style=\"text-align: right;\">165 Feet</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-span5 a-size-base\" style=\"text-align: left;\">Warranty</th>\r\n<td class=\"a-span7 a-size-base\" style=\"text-align: right;\">Please review the manufacturer&rsquo;s website for warranty information.&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>','Heart Rate & Activity Tracking using Google Fit; Built-in GPS for distance tracking; Swimproof design 3ATM; Google Assistant built in - it’s your own personal Google, always ready to help; Speed through checkout with your watch using Google Pay'),(59,59,'en','DJI Spark Portable Mini Drone Alpine White','<div id=\"dpx-product-description_feature_div\">\r\n<div id=\"descriptionAndDetails\" class=\"a-section a-spacing-extra-large\">\r\n<div id=\"productDescription_feature_div\" class=\"celwidget\" data-feature-name=\"productDescription\" data-cel-widget=\"productDescription_feature_div\">\r\n<div id=\"productDescription_feature_div\" class=\"a-row feature\" data-feature-name=\"productDescription\" data-template-name=\"productDescription\" data-cel-widget=\"productDescription_feature_div\">\r\n<div id=\"productDescription\" class=\"a-section a-spacing-small\">\r\n<p><strong>Spark<br /><br />Seize the Moment<br /><br />Overview</strong></p>\r\n<p><strong><br /></strong>Spark is a mini drone that features all of DJI\'s signature technologies, allowing you to seize the moment whenever you feel inspired. With intelligent flight control options, a mechanical gimbal, and a camera with incredible image quality, Spark empowers you to push your creative boundaries.</p>\r\n<p><br /><strong>Pipeline<br />Quick Launch</strong></p>\r\n<p>With FaceAware, Spark lifts off from your hand by recognizing your face.[1] It takes off and hovers in place within seconds of powering on.</p>\r\n<p><br /><strong>Simple Control</strong><br />Take amazing aerial photos using just hand gestures, without a remote controller or mobile device.[1]</p>\r\n<p><br /><strong>Create with Ease</strong><br />Intelligent Flight Modes and intuitive controls help you create cinematic aerial videos with just a few taps.</p>\r\n<p><br /><strong>Edit and Share</strong><br />The DJI GO 4 app features automatic editing templates and an array of filters. Quickly edit videos and share them straight to social media.</p>\r\n<p><br /><strong>Intelligent Flight Modes<br />Smart, reliable, and incredibly intuitive<br />QuickShot<br />Videos with a Tap</strong></p>\r\n<p><strong><br /></strong>Let Spark take professional shots for you. QuickShots help you shoot amazing footage with cinematic composition.<br />Rocket<br />Ascend with the camera pointing downward.<br />Dronie<br />Fly backward and upward, with the camera locked on your subject.<br />Circle<br />Circle around your target.<br />Helix<br />Fly upward, spiraling around your subject.</p>\r\n<p><br /><strong>TapFly<br />Flight at Your Fingertips</strong></p>\r\n<p><strong><br /></strong>In TapFly mode, just envision your shot and Spark captures it for you. Tap your phone screen and Spark, using vision technology, flies in the direction of your tap or exactly where you tapped while actively sensing obstacles. Capture shot after shot with just your fingertips.</p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"/storage/media/ASqcUG193L40JmtU8JcHjErjvO7GI5nXFoX4hODK.png\" alt=\"\" width=\"300\" height=\"300\" /></p>\r\n<h4 class=\"a-spacing-mini\">&nbsp;</h4>\r\n<h4 class=\"a-spacing-mini\">TapFly, Fly at Your Fingertips</h4>\r\n<p>In TapFly mode, just envision your shot and Spark captures it for you. Tap your phone screen and Spark, using vision technology, flies in the direction of your tap or exactly where you tapped while actively sensing obstacles.</p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"/storage/media/G2w417ZUyFPhxaDWUmiY5512F8x9miZeMR8zMIjV.png\" alt=\"\" width=\"300\" height=\"300\" /></p>\r\n<h4 class=\"a-spacing-mini\">&nbsp;</h4>\r\n<h4 class=\"a-spacing-mini\">ActiveTrack, Stay on Target</h4>\r\n<p>With ActiveTrack, Spark automatically recognizes objects of different shapes and sizes then tracks them according to what they are and how fast they move. This makes tracking much easier and more reliable.</p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"/storage/media/9DekrBmZSxCqMu24h0sddKgzh4sOZFg8MTHN9NVo.png\" alt=\"\" width=\"300\" height=\"300\" /></p>\r\n<h4 class=\"a-spacing-mini\">&nbsp;</h4>\r\n<h4 class=\"a-spacing-mini\">Mechanical Gimbal Stabilization</h4>\r\n<p>Spark\'s 2-axis mechanical gimbal and UltraSmooth technology dramatically reduce shake and rolling shutter effect, keeping shots stable and detailed.</p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"/storage/media/IElneqxwpk7ixBVW1mupBDM11ItbHaHbwwjlwl8L.png\" alt=\"\" width=\"300\" height=\"300\" /></p>\r\n<h4 class=\"a-spacing-mini\">&nbsp;</h4>\r\n<h4 class=\"a-spacing-mini\">Powerful Lens, Capture the world</h4>\r\n<p>All Spark images are consistently sharp and vivid with very little color aberration and distortion. Spark\'s camera has an f/2.6 wide-angle lens with a 25 mm equivalent focal length. Five elements are arranged into a single group that fit into a compressed frame.</p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"/storage/media/BmUY9aty6WN5Dqcsqj9zMiREhFdevZX0aY8SkEk6.png\" alt=\"\" width=\"220\" height=\"220\" /></p>\r\n<h4 class=\"a-spacing-mini\">&nbsp;</h4>\r\n<h4 class=\"a-spacing-mini\">Powerful Propulsion</h4>\r\n<p class=\"a-size-small\">With its aerodynamic, lightweight, and slick design, Spark soars through the air with minimal wind resistance. The gimbal and camera are flush with the aircraft, significantly increasing stability. Powerful propulsion offers steady flight in strong winds at up to 31 mph (50 kph) in Sport Mode.2 And an advanced flight control system means flying Spark is fun and intuitive.</p>\r\n<p class=\"a-size-small\">&nbsp;</p>\r\n<p class=\"a-size-small\"><img src=\"/storage/media/e56lUf8B5xCPSZblfXc5VeIdsAxYvhEnkVFOPM6z.png\" alt=\"\" width=\"220\" height=\"220\" /></p>\r\n<h4 class=\"a-spacing-mini\">&nbsp;</h4>\r\n<h4 class=\"a-spacing-mini\">HD Wi-Fi Video Transmission</h4>\r\n<p class=\"a-size-small\">Fly Farther, See More</p>\r\n<p class=\"a-size-small\">Innovative HD Wi-Fi technology allows for 720p real-time video transmission from up to 1.2 mi (2 km) away.*</p>\r\n<p class=\"a-size-small\">*Unobstructed, free of interference, with remote controller when FCC compliant.</p>\r\n<p class=\"a-size-small\">&nbsp;</p>\r\n<p class=\"a-size-small\">&nbsp;</p>\r\n<h2>Product information:</h2>\r\n<p>&nbsp;</p>\r\n<table id=\"productDetails_detailBullets_sections1\" class=\"a-keyvalue prodDetTable\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Product Dimensions</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">9.7 x 8 x 2.8 inches</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item Weight</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">1.46 pounds</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Shipping Weight</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">1.46 pounds</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">ASIN</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">B07CKJBKG8</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Manufacturer recommended age</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">18 years and up</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Batteries</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">1 Lithium ion batteries required.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p class=\"a-size-small\">&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div id=\"dpx-btf-renewed-program-description_feature_div\">\r\n<div id=\"renewedProgramDescriptionBtf_feature_div\" class=\"celwidget\" data-feature-name=\"renewedProgramDescriptionBtf\" data-cel-widget=\"renewedProgramDescriptionBtf_feature_div\"></div>\r\n</div>','2-Axis Stabilized Gimbal Camera; 12MP Still Photos / 1080p/30 Video\r\nGesture and TapFly Control; FlightAutonomy with Obstacle Detection\r\nSubject Tracking from Various Angles; GPS- & Vision Position-Based Navigation'),(60,60,'en','DJI Phantom 3 Professional Quadcopter 4K','<p><span class=\"a-list-item\"><img src=\"/storage/media/vkzbNysMcDzxhB9fLk6EoI67TvSTsYwDkqOx5zBP.jpeg\" alt=\"\" width=\"300\" height=\"300\" />&nbsp;</span></p>\r\n<h4 class=\"a-spacing-mini\">Epic Aerial Video</h4>\r\n<p>With the Phantom 3 Professional, you&rsquo;re shooting 4K video at up to 30 frames per second and capturing 12 megapixel photos that look crisper and cleaner than ever.</p>\r\n<p><span class=\"a-list-item\"><img src=\"/storage/media/YvrdvqWmxUWfcPzvB55pQlZDNqE4zBaNurBJBhQF.jpeg\" alt=\"\" width=\"300\" height=\"300\" />&nbsp;</span></p>\r\n<h4 class=\"a-spacing-mini\">Live HD View</h4>\r\n<p>Simply connect your phone or tablet, and a 720p HD view of everything your camera sees as you fly is displayed live</p>\r\n<p><img src=\"/storage/media/jDX8scoHpoeTIan58eKJg7ku38f6vkEXjWkKIV2z.jpeg\" alt=\"\" width=\"300\" height=\"300\" />&nbsp;</p>\r\n<h4 class=\"a-spacing-mini\">Complete Control</h4>\r\n<p>Keep your Phantom 3 fully under your command while accessing the most-used features right on the included remote controller.</p>\r\n<p><img src=\"/storage/media/1lzB5vYEausFcqdj7FQ1v4PPrCtksNjypCt5jrKt.jpeg\" alt=\"\" width=\"300\" height=\"300\" /> &nbsp;</p>\r\n<h4 class=\"a-spacing-mini\">Powerful Mobile App</h4>\r\n<p>Complete power is at your fingertips. Control the camera and change flight settings, all from your mobile device.</p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"/storage/media/fcBMX4oNkydw3md39H7yU3Utq4qcGrvW9LLzhBhl.jpeg\" alt=\"\" width=\"300\" height=\"300\" />&nbsp;</p>\r\n<h4 class=\"a-spacing-mini\">Vision Positioning</h4>\r\n<p>Fly indoors, low to the ground, and in GPS-free areas with Vision Positioning technology.</p>\r\n<p>&nbsp;</p>\r\n<p>The Phantom 3 Professional continues the proud tradition of DJI\'s Phantom series and brings several important innovations to the Phantom\'s rich feature set. The Phantom 3 Professional carries a fully stabilized 3-axis 4k UHD video camera for smooth, crisp videos and still photos. To allow you to see what the drone sees, DJI has engineered a new generation of their Lightbridge technology that allows 720p HD digital streaming of live video directly from the drone. You can control the camera and see video in real time as you fly and you can even share the video using the DJI Pilot app\'s advanced features. To aid indoor flying, the Phantom 3 Professional includes an integrated array of optical and ultrasonic sensors call Vision Positioning that allows you to fly precisely indoors without a GPS signal. The Phantom 3 Professional includes all the tried-and-true features you\'d expect from a DJI drone, including GPS navigation with auto takeoffs and auto landings, intelligent high power flight battery, a built-in safety database of no fly zones, and a powerful mobile app for your iOS or Android device.</p>\r\n<p><br /><br /><strong>Note:&nbsp;</strong>DJI has locked your Phantom from being able to even start the motor if you live within a 15 mile radius of the White House. This encompasses not only D.C. but much of Prince Georges County, Arlington, Fairfax, Silver Spring, Falls Church and Montgomery County. DJI does not warn you of this prior to purchase. Outside of this 15 mile radius, the drone works great, but be aware, that if you bought it and live within the restricted zone, you will not be able to fly it, even on your own property.</p>\r\n<p>&nbsp;</p>\r\n<h3>Set Contains:</h3>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li style=\"list-style-type: none;\">\r\n<ul>\r\n<li>Aircraft Body (1)</li>\r\n<li>Remote Controller (1)</li>\r\n<li>Propeller Pairs (4)</li>\r\n<li>Intelligent Flight Battery (1)</li>\r\n<li>Battery Charger (1)</li>\r\n<li>Power Cable (1)</li>\r\n<li>Phantom 3 Professional / Advanced Safety Guidelines and Disclaimer (Manual)</li>\r\n<li>Phantom 3 Professional / Advanced Intelligent Flight Battery Safety Guidelines (Manual)</li>\r\n<li>Phantom 3 Professional Quick Start Guide (Manual)</li>\r\n<li>Gimbal Clamp (1)</li>\r\n<li>Vibration Absorbers (4)</li>\r\n<li>16GB Micro-SD Card (1)</li>\r\n<li>Micro-USB Cable (1)</li>\r\n<li>Anti-drop Kit (2)</li>\r\n<li>Landing Pads (4)</li>\r\n<li>Propeller Wrench (1)</li>\r\n<li>Stickers (5 - Gold, Silver, Red, Blue, Pink)</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h2>Product information:</h2>\r\n<table id=\"productDetails_detailBullets_sections1\" class=\"a-keyvalue prodDetTable\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Product Dimensions</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">18 x 13 x 8 inches</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item Weight</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">9.2 pounds</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Shipping Weight</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">9.25 pounds (<a href=\"https://www.amazon.com/gp/help/seller/shipping.html/ref=dp_pd_shipping?_encoding=UTF8&amp;seller=A1JL84PCMGC6ZI&amp;asin=B00VSITBJO\">View shipping rates and policies</a>)</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">ASIN</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">B00VSITBJO</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item model number</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">CP.PT.000181</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Batteries</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">1 Lithium Metal batteries required. (included)</td>\r\n</tr>\r\n</tbody>\r\n</table>','4k UHD video recording with fully stabilized 3-axis gimbal; Vision Positioning system allows stable flight indoors\r\nLightbridge digital streaming allows live viewing of 720p video (full resolution video is simultaneously recorded on the internal microSD card)'),(61,61,'en','DJI Mavic Air Quadcopter with Remote Controller','<p><span class=\"a-list-item\"><img src=\"/storage/media/VeQzhVvEoyvM7OIPUlX5LaC89SzaOzaEA9Gl70GK.jpeg\" alt=\"\" width=\"970\" height=\"300\" /></span></p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-list-item\"><img src=\"/storage/media/peWDXnyehjWIT77Q5Nxdb0Os9ZA21kV4OndDskrk.jpeg\" alt=\"\" width=\"220\" height=\"220\" /> &nbsp;<img src=\"/storage/media/9PUdocYL0AEb3v3AAXaNZv5ZW8TMOdyRnJXesXKi.jpeg\" alt=\"\" width=\"220\" height=\"220\" /> &nbsp;<img src=\"/storage/media/wBLzOfmitYNtNvifsSzNitvQLAgG52H0nwJ3ZuCL.jpeg\" alt=\"\" width=\"220\" height=\"220\" /></span></p>\r\n<p>&nbsp;</p>\r\n<h4 class=\"a-spacing-mini\">A marvel of engineering and design</h4>\r\n<p class=\"a-size-small\">Mavic Air was built to go wherever adventure takes you. Inheriting the best of the Mavic series, this ultraportable and foldable drone features high-end flight performance and functionality for limitless exploration</p>\r\n<h4 class=\"a-spacing-mini\">32 MP Sphere Panoramas</h4>\r\n<p class=\"a-size-small\">In addition to Horizontal, Vertical, and 180&deg; panoramas, the Mavic Air stitches 25 photos together in just eight seconds to create crystal-clear 32 MP Sphere panoramas.1 View them from an immersive perspective with DJI Goggles.</p>\r\n<h4 class=\"a-spacing-mini\">4K 100 Mbps Video</h4>\r\n<p class=\"a-size-small\">The Mavic Air shoots video at an incredible 4K 30 fps, recording at 100 Mbps to capture every second with UHD quality.</p>\r\n<p class=\"a-size-small\">&nbsp;</p>\r\n<p class=\"a-size-small\"><img src=\"/storage/media/qYUfGZm9TiLlLSvdnYYAQRxBnPiR5KNvCMXJQomi.jpeg\" alt=\"\" width=\"220\" height=\"220\" /> &nbsp;<img src=\"/storage/media/8SKIefZgi4ThmQhHoHun4qPBEi3KHYG5BNsqciyk.jpeg\" alt=\"\" width=\"220\" height=\"220\" /> &nbsp;<img src=\"/storage/media/u97csICxmWwR43gl4zJBDD5EUY5GiyyvRSmesf58.jpeg\" alt=\"\" width=\"220\" height=\"220\" /></p>\r\n<p class=\"a-size-small\">&nbsp;</p>\r\n<h4 class=\"a-spacing-mini\">Slow-Motion Video</h4>\r\n<p class=\"a-size-small\">With support for recording 1080p 120 fps slow-motion video, the Mavic Air captures all your epic high-speed adventures.</p>\r\n<h4 class=\"a-spacing-mini\">HDR Photos</h4>\r\n<p class=\"a-size-small\">New HDR algorithms help you obtain the right exposure settings intelligently, according to lighting conditions. Overexposed or dark areas are processed for more natural transitions between highlights and shadows, while DSP acceleration allows for more efficient shooting.</p>\r\n<h4 class=\"a-spacing-mini\">Geometric Elegance</h4>\r\n<p class=\"a-size-small\">Expressing geometric precision, the Mavic Air\'s arms fold flush against its aerodynamic chassis. Magnesium alloy brackets reinforce the seven onboard cameras, rear vents dissipate heat efficiently, and the primary gimbal camera is recessed for better protection.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Details:</strong></p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">32.0MP sphere panoramas - In addition to horizontal, vertical, and 180&deg; panoramas, Mavic Air stitches 25 photos together in just eight seconds to create crystal clear 32.0MP sphere panoramas.</span></li>\r\n<li><span class=\"a-list-item\">Lightweight and compact foldable design - You can take it anywhere with you.</span></li>\r\n<li><span class=\"a-list-item\">Supports 4K video at 30 fps - The 12.0MP camera with Adobe DNG RAW support is ready to shoot. The three-axis gimbal is capable of stabilizing the camera even during high-speed motion for smooth video and sharp photos.</span></li>\r\n<li><span class=\"a-list-item\">Control your drone from up to 6562\' away - The Mavic Air Intelligent Flight lithium battery provides up to 21 minutes of flight time per charge.</span></li>\r\n<li><span class=\"a-list-item\">Dedicated remote controller- Features a foldable, low-profile, ergonomic design to hold your smartphone for maximum convenience. The detachable control sticks store inside the remote controller to pack more comfortably on the go.</span></li>\r\n<li><span class=\"a-list-item\">Fly by phone - Set up tracking to shoot a friend, or head skywards for a quick flight using your smartphone instead of controller.</span></li>\r\n<li><span class=\"a-list-item\">Share with your friends - Shoot an incredible scene and edit it with just a few taps in the DJI GO editor, and share it instantly for everyone to see.</span></li>\r\n</ul>\r\n<div class=\"a-row a-expander-container a-expander-inline-container\" aria-live=\"polite\">\r\n<div class=\"a-expander-content a-expander-extend-content a-expander-content-expanded\" aria-expanded=\"true\">\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">Safe flight - Its five vision sensors, GPS and GLONASS, a pair of ultrasonic range finders, redundant sensors, and a group of 24 powerful specialized computers make sure that your drone is flying safely.</span></li>\r\n<li><span class=\"a-list-item\">SmartCapture - Fun, simple, and intuitive, SmartCapture offers a new and interactive way of controlling the Mavic Air by hand. Launch and control the drone with hand gestures, then take photos or videos however you like.</span></li>\r\n<li><span class=\"a-list-item\">Included - DJI Mavic Air Quadcopter with Remote Controller, Intelligent flight battery, Charger and power cable, Four pairs of propellers, Propeller guards (set), RC cable (Lightning connector), RC cable (standard micro USB connector), RC cable (USB type-C connector), Gimbal protector and spare control sticks (pair), Communication cable (USB3.0 type-C), USB adapter, Two RC cable slider (large) and two RC cable slider (small), Carrying case</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h2>Product information:</h2>\r\n<table id=\"productDetails_detailBullets_sections1\" class=\"a-keyvalue prodDetTable\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Product Dimensions</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">6.5 x 1.6 x 3.2 inches</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item Weight</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">15.2 ounces</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Shipping Weight</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">3.8 pounds</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">ASIN</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">B078WQ9SN3</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item model number</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">CP.PT.00000130.01</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Batteries</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">1 Lithium Polymer batteries required.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','Adventure Unfolds, 32 MP Sphere Panoramas, Foldable and Portable, 3-Axis Gimbal and 4K Camera, 3-Directional Environment Sensing'),(62,62,'en','DJI Mavic Mini - Drone FlyCam Quadcopter UAV with 2.7K Camera','<p><span class=\"a-list-item\"><img src=\"/storage/media/PzjZ0byC4tk0qzMa90U3Astkp6kmtbI1EmWCriLj.jpeg\" alt=\"\" width=\"1464\" height=\"600\" /></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-list-item\"><iframe src=\"https://www.youtube.com/embed/hS_OjalEpZI\" width=\"1000\" height=\"563\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></span></p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-list-item\"><img src=\"/storage/media/GkWUyRhqWKTRd1inVdr2h07pirYmk09Ilfn25dF0.jpeg\" alt=\"\" width=\"800\" height=\"600\" />&nbsp;</span></p>\r\n<h1 class=\"aplus-h1 aplus-module-1-heading a-text-bold\">Almost as Light as a Smartphone</h1>\r\n<p class=\"aplus-p2 aplus-module-1-description\">Weighing under 250 grams, Mavic Mini is almost as light as the average smartphone. This makes it exceptionally portable and places it in the lowest and safest weight class of drones, which in many countries may exempt it from certain regulations. Aircraft takeoff weight includes battery, propellers, and a microSD card.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong><span class=\"a-list-item\">Details:</span></strong></p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">The compact yet powerful Mavic Mini camera drone is the perfect creative companion, capturing your moments in a way that effortlessly elevates the ordinary</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">Weighing less than 0.55lbs / 250 grams, Mavic Mini is almost as light as the average smartphone. In the United States and Canada, you can fly this camera drone without the need to register your drone with the government</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">Mavic Mini supports 12MP aerial photos and 2.7K HD videos. A 3-axis motorized gimbal provides superior camera stability and ensures clear, Ultra-smooth footage</span></li>\r\n<li><span class=\"a-list-item\">Mavic Mini&rsquo;s weight allows it to stay in the air longer than similar consumer FlyCams on the market. Enjoy up to 30 minutes of flight time with a fully-charged battery</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">DJI Fly App requires iOS v10.0, Android v6.0 or above. Compatible devices include: iPhone 11 Pro Max, 11 Pro, 11, XS Max, XS, XR, X, 8 Plus, 8, 7 Plus, 7, 6s Plus, 6s, 6 Plus, 6, Samsung Galaxy S10+, S10, S9+, S9 , S8+, S8, S7 edge, S7, S6, Note9, Note8, Huawei P30 Pro, P30, P20, P10, Mate 20 Pro, Mate 10, nova 5, nova 4, nova 3e, nova 2, Honor 8X, 10, 9, 20 Pro, Magic 2, Mi 8, MIX 2S, MIX 2, Redmi Note 5, Oppo Find X, R15, Vivo NEX, X27, X21, X20A, OnePlus 7, 6T, 5, Pixel 3 XL, 2 XL, 2, LG V20, LG G6</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h2>Product information:</h2>\r\n<p>&nbsp;</p>\r\n<table id=\"productDetails_detailBullets_sections1\" class=\"a-keyvalue prodDetTable\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Product Dimensions</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">6.3 x 3.1 x 0.4 inches</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item Weight</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">1.8 pounds</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Shipping Weight</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">1.85 pounds (<a href=\"https://www.amazon.com/gp/help/seller/shipping.html/ref=dp_pd_shipping?_encoding=UTF8&amp;seller=ATVPDKIKX0DER&amp;asin=B07RQJHG8M\">View shipping rates and policies</a>)</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">ASIN</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">B07RQJHG8M</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item model number</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">CP.MA.00000120.01</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Batteries</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">1 Lithium Polymer batteries required. (included)</td>\r\n</tr>\r\n</tbody>\r\n</table>','DJI Mavic Mini - Drone FlyCam Quadcopter UAV with 2 7K Camera 3-Axis Gimbal GPS 30min Flight Time less than 0 55lbs Gray'),(63,63,'en','SAMSUNG QN32Q50RAFXZA Flat 32\" QLED','<h1 style=\"text-align: center;\"><span class=\"aplus-accent1 aplus-module-1-topic a-text-bold\">SAMSUNG QN32Q50RAFXZA Flat 32\" QLED</span></h1>\r\n<p>&nbsp;</p>\r\n<p><span class=\"aplus-accent1 aplus-module-1-topic a-text-bold\">Brilliant color in dark or bright scenes</span></p>\r\n<h1 class=\"aplus-h1 aplus-module-1-heading a-text-bold\">Step up to a whole new world of QLED color</h1>\r\n<p class=\"aplus-p2 aplus-module-1-description\">Quantum Dot technology lets you experience images bursting with a dazzling range of over a billion colors, each upscaled to incredible clarity thanks to our intelligent UHD processor.</p>\r\n<p class=\"aplus-p2 aplus-module-1-description\">&nbsp;</p>\r\n<p class=\"aplus-p2 aplus-module-1-description\">&nbsp;</p>\r\n<p><img src=\"/storage/media/NfTBCITvhRJ2C3SHyuI0ynaUfEJHUhsdx4e43Ebj.jpeg\" alt=\"\" width=\"1464\" height=\"600\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-list-item\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/h2Mj4m0gNDMnBch96RsJmLePRPIelPpWNs2XtMuz.jpeg\" alt=\"\" width=\"650\" height=\"349\" /></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-list-item\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/ADEzBRk6QdrbbAcxdeWPdfFLjGb3PpKHlCQCHDC1.jpeg\" alt=\"\" width=\"650\" height=\"350\" /></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-list-item\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/nHyTTW89D4vgFJU91N7gskZNJasoijlZaRXbTWCY.jpeg\" alt=\"\" width=\"650\" height=\"350\" /></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-list-item\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/z6TsQAfwEG1SFYHrDJhMTJsZEivId6xap3QEbVRw.jpeg\" alt=\"\" width=\"650\" height=\"350\" /></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-list-item\">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>Details:</strong></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><span class=\"a-list-item\">4K UHD Processor: a powerful processor optimizes your tv&rsquo; s performance with 4K picture quality</span></p>\r\n<p style=\"text-align: center;\"><span class=\"a-list-item\">HD: see shades of color that reveal more detail than HDTV can deliver</span></p>\r\n<p style=\"text-align: center;\"><span class=\"a-list-item\">100% Color Volume with Quantum Dot*: Over a billion shades of brilliant color&mdash;powered by Quantum Dots&mdash;deliver our most realistic picture</span></p>\r\n<p style=\"text-align: center;\"><span class=\"a-list-item\">4K UHD: see what you&rsquo;ve been missing on a crisp, clear picture that&rsquo;s 4x the resolution of Full HD</span></p>\r\n<p style=\"text-align: center;\"><span class=\"a-list-item\">Smart TV with Universal Guide: our simple on-screen Guide is an easy way to find streaming content and live TV shows</span></p>\r\n<p style=\"text-align: center;\"><span class=\"a-list-item\">Sound Output (RMS): 20W</span></p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-list-item\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/Q45hVFpdOsh3xDHW78HLVRirg7OXlUIwh4zvTVXY.jpeg\" alt=\"\" width=\"800\" height=\"600\" /></span></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Product information:</strong></p>\r\n<p>&nbsp;</p>\r\n<table id=\"productDetails_techSpec_section_1\" class=\"a-keyvalue prodDetTable\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Brand Name</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">Samsung</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item Weight</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">11.9 pounds</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Product Dimensions</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">6.1 x 28.5 x 18.8 inches</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item model number</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">QN32Q50RAFXZA</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Color Name</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">Black</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Special Features</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">4K UHD Processor;&nbsp; Slim Design; 100% Color Volume with Quantum Dot</td>\r\n</tr>\r\n</tbody>\r\n</table>','Samsung 32\" QLED Smart TV. A picture that\'s worth a billion colors. Step up to a whole new world of Color. Quantum Dot technology lets you experience images bursting with a dazzling range of over one billion colors.'),(64,64,'en','Samsung QN55Q80RAFXZA Flat 55-Inch QLED 4K','<h1 style=\"text-align: center;\">Samsung QN55Q80RAFXZA Flat 55-Inch QLED 4K</h1>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-list-item\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/bp0SWBTpHQjvmQJTxNDPLMDwAE0FPhk5yFEmHiKa.jpeg\" alt=\"\" width=\"1464\" height=\"600\" /></span></p>\r\n<p>&nbsp;</p>\r\n<h3 class=\"aplus-p3\" style=\"text-align: center;\">Direct Full Array 8X</h3>\r\n<h1 class=\"aplus-h1 a-text-bold\" style=\"text-align: center;\">Precision makes perfect</h1>\r\n<p class=\"description aplus-p1\" style=\"text-align: center;\">Precisely controlled LEDs intelligently adjust to deliver rich blacks and crisp, bright whites.</p>\r\n<p class=\"description aplus-p1\">&nbsp;</p>\r\n<p class=\"description aplus-p1\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/GkYpjm2k3ZbrYZB5AtHiS6yh4qEtO0fZ6yvXs8ms.jpeg\" alt=\"\" width=\"650\" height=\"350\" /></p>\r\n<p class=\"description aplus-p1\">&nbsp;</p>\r\n<div class=\"a-section a-spacing-none column-heading\">\r\n<h1 class=\"aplus-h3 a-text-bold\" style=\"text-align: center;\">100% Color Volume with Quantum Dot*</h1>\r\n</div>\r\n<div class=\"a-section a-spacing-none column-description\">\r\n<p class=\"aplus-p3\" style=\"text-align: center;\">Over a billion shades of brilliant color&mdash;powered by Quantum Dots&mdash;deliver our most realistic picture.</p>\r\n<p class=\"aplus-p3\" style=\"text-align: center;\"><span class=\"a-text-italic\">*QLED televisions can produce 100% Color Volume in the DCI-P3 color space, the format for most cinema screens and HDR movies for television.</span></p>\r\n<p class=\"aplus-p3\" style=\"text-align: center;\">&nbsp;</p>\r\n</div>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/B3XCER4OaFdw6wt6DVzg04mN1QZIgUP32kaaKetX.jpeg\" alt=\"\" width=\"650\" height=\"350\" /></p>\r\n<div class=\"a-section a-spacing-none column-heading\">\r\n<h1 class=\"aplus-h3 a-text-bold\">&nbsp;</h1>\r\n<h1 class=\"aplus-h3 a-text-bold\" style=\"text-align: center;\">Ambient Mode</h1>\r\n</div>\r\n<div class=\"a-section a-spacing-none column-description\">\r\n<p class=\"aplus-p3\" style=\"text-align: center;\">Complements your space by turning a blank screen into enticing visuals or at-a-glance news.*</p>\r\n<p class=\"aplus-p3\" style=\"text-align: center;\"><span class=\"a-text-italic\">*Background feature accuracy may vary based on TV location and is dependent on wall designs, patterns and/or colors. </span></p>\r\n<p class=\"aplus-p3\" style=\"text-align: center;\"><span class=\"a-text-italic\">SmartThings app on a mobile device (Android, iOS) is required for some functionality.</span></p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"a-section a-spacing-none column-description\">\r\n<p class=\"aplus-p3\">&nbsp;</p>\r\n<p class=\"aplus-p3\"><span class=\"a-text-italic\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/tBAhDCDnH8vTU2IfqfZcfAmw9L0LZCzd6n21v1xt.jpeg\" alt=\"\" width=\"650\" height=\"350\" /></span></p>\r\n<p class=\"aplus-p3\">&nbsp;</p>\r\n<div class=\"a-section a-spacing-none column-heading\">\r\n<h1 class=\"aplus-h3 a-text-bold\" style=\"text-align: center;\">Bixby on TV</h1>\r\n</div>\r\n<div class=\"a-section a-spacing-none column-description\">\r\n<p class=\"aplus-p3\" style=\"text-align: center;\">Control your TV with just your voice.*</p>\r\n<p class=\"aplus-p3\" style=\"text-align: center;\"><span class=\"a-text-italic\">*Bixby voice command recognizes English (U.S.), Mandarin Chinese and Korean. Not all accents, dialects and expressions are recognized. </span></p>\r\n<p class=\"aplus-p3\" style=\"text-align: center;\"><span class=\"a-text-italic\">The list of features that can be controlled by voice commands via Bixby will continue to expand.</span></p>\r\n<p class=\"aplus-p3\">&nbsp;</p>\r\n<p class=\"aplus-p3\"><span class=\"a-text-italic\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/5pyHITOdidJmfGVoajrqy5lkR14JyMQDNrhKpNhK.jpeg\" alt=\"\" width=\"650\" height=\"350\" /></span></p>\r\n</div>\r\n<p class=\"aplus-p3\">&nbsp;</p>\r\n<p class=\"aplus-p3\">&nbsp;</p>\r\n</div>\r\n<div class=\"a-section a-spacing-none column-heading\">\r\n<h1 class=\"aplus-h3 a-text-bold\" style=\"text-align: center;\">Smart TV with Universal Guide</h1>\r\n</div>\r\n<div class=\"a-section a-spacing-none column-description\" style=\"text-align: center;\">\r\n<p class=\"aplus-p3\">Our simple on-screen guide is an easy way to find streaming content and live TV shows.</p>\r\n</div>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p><strong><span class=\"a-list-item\">Description:</span></strong></p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">100% COLOR VOLUME WITH QUANTUM DOTS: Powered by Quantum dots, Samsung&rsquo;s 4K QLED TV offers over a billion shades of brilliant color and 100% color volume for exceptional depth of detail that will draw you in to the picture for the best 4K TV experience</span></li>\r\n<li><span class=\"a-list-item\">DIRECT FULL ARRAY BACKLIGHT 8X: Concentrated zones of precision controlled LEDs auto adjust contrast between pure whites and ultra deep blacks, revealing hidden details in even the darkest scenes</span></li>\r\n<li><span class=\"a-list-item\">QUANTUM PROCESSOR 4K: Intelligently powered processor instantly upscales content to 4K for sharp detail and refined color; Stand Size (WxHxD) 1 x 7 x 10.1 inches</span></li>\r\n<li><span class=\"a-list-item\">QUANTUM HDR 12X: 4K depth of detail with high dynamic range powered by HDR10+ delivers the lightest to darkest colors, scene by scene, for amazing picture realism</span></li>\r\n<li><span class=\"a-list-item\">ULTRA VIEWING ANGLE: Engineered to reduce glare and enhance color even in bright rooms, the ultra viewing angle provides for a vibrant picture no matter where you sit around this big screen TV</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Product information:</strong></p>\r\n<p>&nbsp;</p>\r\n<table id=\"productDetails_techSpec_section_1\" class=\"a-keyvalue prodDetTable\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Brand Name</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">Samsung</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item Weight</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">42.1 pounds</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Product Dimensions</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">2.4 x 48.4 x 27.9 inches</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">California residents</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\"><a href=\"https://www.amazon.com/gp/help/customer/display.html/ref=dp_prop65_warn?ie=UTF8&amp;nodeId=3234041\">Click here</a>&nbsp;for Proposition 65 warning</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item model number</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">QN55Q80RAFXZA</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Discontinued by manufacturer</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">Yes</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Color Name</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">Silver</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Speaker Type</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">4.1CH</td>\r\n</tr>\r\n</tbody>\r\n</table>','100% COLOR VOLUME WITH QUANTUM DOTS: Powered by Quantum dots, Samsung’s 4K QLED TV offers over a billion shades of brilliant color and 100% color volume for exceptional depth of detail that will draw you in to the picture for the best 4K TV experience'),(65,65,'en','Samsung QN65Q90RAFXZA Flat 65-Inch QLED 4K','<p><img src=\"/storage/media/sZ9zRA6JvQxXsrheYUQeJ2wU9kVMu8vDnRTolKtM.jpeg\" alt=\"\" width=\"1464\" height=\"600\" /></p>\r\n<p>&nbsp;</p>\r\n<h3 class=\"aplus-p3\">Direct Full Array 16X</h3>\r\n<h1 class=\"aplus-h1 a-text-bold\">Precision makes perfect</h1>\r\n<p class=\"description aplus-p1\">Concentrated zones of precision-controlled LEDs display ultra-deep blacks and pure whites.</p>\r\n<p class=\"description aplus-p1\">&nbsp;</p>\r\n<table style=\"border-collapse: collapse; width: 100%; margin-left: auto; margin-right: auto;\" border=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 50%;\">\r\n<p>&nbsp;</p>\r\n<p><img src=\"/storage/media/YXUZVb0tPEDOaocHmQlAh9TbQ5aZqZyjSGKBNyM2.jpeg\" alt=\"\" width=\"651\" height=\"350\" /></p>\r\n<p>&nbsp;</p>\r\n<div class=\"a-section a-spacing-none column-heading\">\r\n<h1 class=\"aplus-h3 a-text-bold\">Ambient Mode</h1>\r\n</div>\r\n<div class=\"a-section a-spacing-none column-description\">\r\n<p class=\"aplus-p3\">Complements your space by turning a blank screen into enticing visuals or at-a-glance news.*</p>\r\n<p class=\"aplus-p3\"><span class=\"a-text-italic\">*Background feature accuracy may vary based on TV location and is dependent on wall designs, patterns and/or colors. SmartThings app on a mobile device (Android, iOS) is required for some functionality.</span></p>\r\n</div>\r\n<p>&nbsp;</p>\r\n</td>\r\n<td style=\"width: 50%;\">\r\n<p><img src=\"/storage/media/OzcNkBH2cuI0mXN0wz3g63YXRkJUven7W8YLjWMR.jpeg\" alt=\"\" width=\"651\" height=\"350\" /></p>\r\n<p>&nbsp;</p>\r\n<div class=\"a-section a-spacing-none column-heading\">\r\n<h1 class=\"aplus-h3 a-text-bold\">One Invisible Connection &amp; No Gap Wall-Mount</h1>\r\n</div>\r\n<div class=\"a-section a-spacing-none column-description\">\r\n<p class=\"aplus-p3\">Your TV hangs flush to the wall, while a single, slim cable connects everything.*</p>\r\n<p class=\"aplus-p3\"><span class=\"a-text-italic\">*A small gap between the wall and TV may occur if wall is not 100% flat or is constructed off-angle to the floor or if installed incorrectly.</span></p>\r\n</div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 50%;\">\r\n<p>&nbsp;</p>\r\n<p><img src=\"/storage/media/LLc7rRyqabPv7bDdCKGCjzoQ2r2cS5DHa4sIukCz.jpeg\" alt=\"\" width=\"651\" height=\"350\" /></p>\r\n<p>&nbsp;</p>\r\n<div class=\"a-section a-spacing-none column-heading\">\r\n<h1 class=\"aplus-h3 a-text-bold\">Bixby on TV</h1>\r\n</div>\r\n<div class=\"a-section a-spacing-none column-description\">\r\n<p class=\"aplus-p3\">Control your TV with just your voice.*</p>\r\n<p class=\"aplus-p3\"><span class=\"a-text-italic\">*Bixby voice command recognizes English (U.S.), Mandarin Chinese and Korean. Not all accents, dialects and expressions are recognized. The list of features that can be controlled by voice commands via Bixby will continue to expand.</span></p>\r\n</div>\r\n</td>\r\n<td style=\"width: 50%;\">\r\n<p>&nbsp;</p>\r\n<p><img src=\"/storage/media/wnAHZNmlFc5iDob8RDYmGUbgZGsmU70ebMPG8EL8.jpeg\" alt=\"\" width=\"651\" height=\"350\" /></p>\r\n<div class=\"a-section a-spacing-none column-heading\">\r\n<h1 class=\"aplus-h3 a-text-bold\">Available on all 2019 Samsung QLED TVs</h1>\r\n</div>\r\n<div class=\"a-section a-spacing-none column-description\">\r\n<p class=\"aplus-p3\">Features such as 100% Color Volume, Bixby Voice and Ambient Mode are now standard on Samsung&rsquo;s QLED TV lineup.</p>\r\n</div>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<table style=\"border-collapse: collapse; width: 151.885%; margin-left: auto; margin-right: auto; height: 663px;\" border=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 33.0942%;\"><img src=\"/storage/media/vOpajESovcDS7Ne8Gb9tEAOZzcDRVg3SFuDIotLW.jpeg\" alt=\"\" width=\"800\" height=\"600\" /></td>\r\n<td style=\"width: 57.838%;\"><span class=\"aplus-accent1 aplus-module-1-topic a-text-bold\">The pinnacle of our 4K TVs</span>\r\n<h1 class=\"aplus-h1 aplus-module-1-heading a-text-bold\">Unveiling Hidden Detail&nbsp; &nbsp; &nbsp;</h1>\r\n<p class=\"aplus-p2 aplus-module-1-description\">Once it draws your eye, you&rsquo;ll want to watch more. Colors spring to life in breathtaking new shades with our finest 4K HDR, and a full array of concentrated LED zones reveals hidden details in even the darkest scenes. You need to see it to believe it.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>Description:</strong></p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">100% COLOR VOLUME WITH QUANTUM DOTS: Powered by Quantum dots, Samsung&rsquo;s 4K QLED TV offers over a billion shades of brilliant color and 100% color volume for exceptional depth of detail that will draw you in to the picture for the best 4K TV experience</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">DIRECT FULL ARRAY BACKLIGHT 16X: Concentrated zones of precision-controlled LEDs auto-adjust contrast between pure whites and ultra-deep blacks, revealing hidden details in even the darkest scenes</span></li>\r\n<li><span class=\"a-list-item\">QUANTUM PROCESSOR 4K: Intelligently powered processor instantly upscales content to 4K for sharp detail and refined color</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">QUANTUM HDR 16X: 4K depth of detail with high dynamic range powered by HDR10+ lets you discover a new frontier of spectacular color and incredible detail, just as the director intended</span></li>\r\n<li><span class=\"a-list-item\">ULTRA-VIEWING ANGLE: Engineered to reduce glare and enhance color even in bright rooms, the ultra-viewing angle provides for a vibrant picture no matter where you sit around this big screen TV</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Product information:</strong></p>\r\n<p>&nbsp;</p>\r\n<table id=\"productDetails_techSpec_section_1\" class=\"a-keyvalue prodDetTable\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Brand Name</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">Samsung</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item Weight</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">76.9 pounds</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Product Dimensions</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">1.6 x 57.1 x 32.7 inches</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">California residents</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\"><a href=\"https://www.amazon.com/gp/help/customer/display.html/ref=dp_prop65_warn?ie=UTF8&amp;nodeId=3234041\">Click here</a>&nbsp;for Proposition 65 warning</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item model number</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">QN65Q90RAFXZA</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Batteries</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">2 AAA batteries required.</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Discontinued by manufacturer</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">Yes</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Color Name</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">Silver</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Speaker Type</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">4.2CH</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>','QUANTUM PROCESSOR 4K: Intelligently powered processor instantly upscales content to 4K for sharp detail and refined color\r\nQUANTUM HDR 16X: 4K depth of detail with high dynamic range powered by HDR10+ lets you discover a new frontier of spectacular color and incredible detail, just as the director intended'),(66,66,'en','LG Electronics LG SIGNATURE OLED77G7P 77-Inch 4K','<h3 class=\"a-spacing-mini\" style=\"text-align: center;\">LG Signature OLED TV G - 4K HDR Smart TV - 77\" Class (76.8 Diag) - OLED77G7P</h3>\r\n<p>&nbsp;</p>\r\n<table style=\"border-collapse: collapse; width: 101.915%; height: 578px; margin-left: auto; margin-right: auto;\" border=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 25.1064%;\">\r\n<p><img src=\"/storage/media/mqIdRyAUBGJvCz7PogXN8iEbqjdVl4kPb0oxfAdb.jpeg\" alt=\"\" width=\"220\" height=\"220\" /></p>\r\n</td>\r\n<td style=\"width: 24.8936%;\"><img src=\"/storage/media/aYtrlqrm1ZpzpNLJIAYp9qlPqx43EuJxxJ6Qd8XD.jpeg\" alt=\"\" width=\"220\" height=\"220\" /></td>\r\n<td style=\"width: 25%;\"><img src=\"/storage/media/bEkMQOB1zqBrwKugVDtz1Pq1uRQAfC08lHAbgRaZ.jpeg\" alt=\"\" width=\"220\" height=\"220\" /></td>\r\n<td style=\"width: 25%;\"><img src=\"/storage/media/KFc7gJ3Opx502U5aeKI3aWi9CprTgxHjHxkwYWNQ.jpeg\" alt=\"\" width=\"220\" height=\"220\" /></td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 25.1064%;\">\r\n<h4 class=\"a-spacing-mini\">Picture on Glass, A work of art</h4>\r\n<p class=\"a-size-small\">The elegance of glass combines with the unparalleled sophistication of OLED for an image that appears to float in the air. Picture-on-Glass design places the incomparably thin, flexible, lightweight OLED panel&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</td>\r\n<td style=\"width: 24.8936%;\">\r\n<h4 class=\"a-spacing-mini\">Intense Color on Perfect Black</h4>\r\n<p class=\"a-size-small\">Picture night skies as dark as night skies themselves. Against the infinite, inky darkness of perfect black, colors pop and images come alive. LG OLED pixels are what make it all possible, each turning on and off individually for truly infinite contrast.</p>\r\n</td>\r\n<td style=\"width: 25%;\">\r\n<h4 class=\"a-spacing-mini\">Dolby Vision and Dolby Atmos, True Home Cinema</h4>\r\n<p class=\"a-size-small\">LG OLED TV is the ultimate expression of a cinema-quality experience in the home. Premium content achieves the pinnacle of picture quality thanks to Active HDR with Dolby Vision. The Dolby Atmos audio is just as impressive, surrounding the audience as in the most advanced theaters.</p>\r\n</td>\r\n<td style=\"width: 25%;\">\r\n<h4 class=\"a-spacing-mini\">Bring Big Screen Sound to the Living Room</h4>\r\n<p class=\"a-size-small\">Straight from state-of-the-art theaters to the home, Dolby Atmos creates sound that can appear to come from anywhere. Crickets all around. Explosions from above. A villain laughing behind. With LG OLED TV, audio becomes an incredibly realistic, immersive experience.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/5IR7UtwozyoseWNIOr56dzpSQSJ3EvEnmPaKjMMi.jpeg\" alt=\"\" width=\"300\" height=\"300\" /></p>\r\n<h4 class=\"a-spacing-mini\">&nbsp;</h4>\r\n<h2 class=\"a-spacing-mini\" style=\"text-align: center;\">Watch what you want, when you want</h2>\r\n<p style=\"text-align: center;\">Netflix Recommended TV recognizes Smart TVs that meet strict criteria for a superior Netflix experience, such as easy app access and new features. For the third year in a row, LG TVs have the distinction of being recommended by Netflix!*</p>\r\n<p style=\"text-align: center;\">Netflix streaming membership required. Ultra HD availability subject to your Netflix subscription plan, Internet service, device capabilities, and content availability.</p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/mq9bOpYLR50p1hpMSbEpXeS0WAdAE2ip3tpHuWnD.jpeg\" alt=\"\" width=\"300\" height=\"300\" /></p>\r\n<h2 style=\"text-align: center;\"><strong>Sling TV</strong></h2>\r\n<p style=\"text-align: center;\">Introducing A La Carte TV, the only live TV service that lets you personalize your channel lineup and save. Customize with your favorite extras like Sports, Comedy, Kids, News, Hollywood, Lifestyle and more. Watch 7 Days Free! Restrictions apply.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Description:</strong></p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">Dimensions (w x H x D): TV without stand: 68.3\" x 42\" x 3.3\", TV with stand: 68.3\" x 41.5\" x 12.5\"</span></li>\r\n<li><span class=\"a-list-item\">Smart functionality gives you access to your favorite apps and content using webOS 3.5. CONNECTIVITY : Wi-Fi Built In 802.11ac</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">Pairs 4K Ultra HD picture clarity with the contrast, color, and detail of High Dynamic Range (HDR) for the most lifelike picture</span></li>\r\n<li><span class=\"a-list-item\">Individually lit OLED pixels achieve the ultimate contrast for outstanding picture quality</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">OLED does not require a backlight giving it deep blacks and making it extremely thin</span></li>\r\n<li><span class=\"a-list-item\">Inputs: 4 HDMI, 3 USB, 1 RF, 1 Composite, Component Shared w/ Composite, 1 Ethernet, 1 Optical, 1 RS232C (Mini Jack). Smart TV Operating System-webOS 3.5</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Product information:</strong></p>\r\n<p>&nbsp;</p>\r\n<table id=\"productDetails_techSpec_section_1\" class=\"a-keyvalue prodDetTable\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Brand Name</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">LG</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item Weight</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">119.3 pounds</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Product Dimensions</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">68.3 x 12.5 x 41.5 inches</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">California residents</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">for Proposition 65 warning</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item model number</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">OLED77G7</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Batteries</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">2 AA batteries required. (included)</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Color Name</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">Black</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>','Key Features:\r\n\r\n- Picture-on-Glass.\r\n\r\n- Intense Color on Perfect Black.\r\n\r\n- Active HDR with Dolby Vision.\r\n\r\n- Dolby Atmos.\r\n\r\n- webOS 3.5 Smart TV.'),(67,67,'en','LG Electronics OLED65E8PUA 65-Inch 4K Ultra HD','<h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"text-align: center;\"><span id=\"productTitle\" class=\"a-size-large\">LG Electronics OLED65E8PUA 65-Inch</span></h1>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/cyWkJyHQJnKkGGgxjVfoLYIPGWcWvrxI6LmDE7Oy.jpeg\" alt=\"\" width=\"1080\" height=\"334\" /></p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/YNF4xpjxVUY8H0YXWGhpaA208LJbYOfpl9Wv7NnD.jpeg\" alt=\"\" width=\"1080\" height=\"334\" /></p>\r\n<h2>&nbsp;</h2>\r\n<h2 style=\"text-align: center;\"><strong>Features</strong></h2>\r\n<h2><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/n6gWroIN8q6EiFqVUNlMJ2AaXiWd6sC46sZqOKYP.jpeg\" alt=\"\" width=\"331\" height=\"331\" /></h2>\r\n<h4 class=\"a-spacing-mini\" style=\"text-align: center;\">Dolby Vision and Dolby Atmos, True Home Cinema</h4>\r\n<p class=\"a-size-small\" style=\"text-align: center;\">LG OLED TV is the ultimate expression of a cinema-quality experience in the home.</p>\r\n<p class=\"a-size-small\" style=\"text-align: center;\">Premium content achieves the pinnacle of picture quality thanks to Active HDR with Dolby Vision.</p>\r\n<p class=\"a-size-small\" style=\"text-align: center;\">The Dolby Atmos audio is just as impressive, surrounding the audience as in the most advanced theaters.</p>\r\n<p class=\"a-size-small\">&nbsp;</p>\r\n<p class=\"a-size-small\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/7V9dusjBUKNfidXP1R2f8H5ZUYc7m3lnQHiI30fw.jpeg\" alt=\"\" width=\"300\" height=\"300\" /></p>\r\n<h4 class=\"a-spacing-mini\" style=\"text-align: center;\">&nbsp;</h4>\r\n<h4 class=\"a-spacing-mini\" style=\"text-align: center;\">A Brilliant Brain</h4>\r\n<p style=\"text-align: center;\">LG&mdash;the industry leaders of OLED TVs&mdash;made the Best TV Ever even better by developing the &alpha;9 Intelligent Processor.</p>\r\n<p style=\"text-align: center;\">LG\'s most powerful processor ever provides true-to-life images with incredibly rich colors,</p>\r\n<p style=\"text-align: center;\">sharpness and depth to deliver the ultimate picture quality.</p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/ErmAOVpT7RecWoBU5Luy13jKG55g4zETnUlwZtFf.jpeg\" alt=\"\" width=\"300\" height=\"300\" /></p>\r\n<h4 class=\"a-spacing-mini\" style=\"text-align: center;\">&nbsp;</h4>\r\n<h4 class=\"a-spacing-mini\" style=\"text-align: center;\">OLED Pixel Level Dimming</h4>\r\n<p style=\"text-align: center;\">Each of the 8.3 million individually lit pixels of the LG OLED TV with AI ThinQ can brighten,</p>\r\n<p style=\"text-align: center;\">dim or power off completely, achieving perfect black and displaying a level of picture detail</p>\r\n<p style=\"text-align: center;\">impossible with any other television technology.</p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/9zRMZB8s3aeL45PBiR1oWDgj9GZL80QryTR8SqRT.jpeg\" alt=\"\" width=\"300\" height=\"300\" /></p>\r\n<h4 class=\"a-spacing-mini\" style=\"text-align: center;\">&nbsp;</h4>\r\n<h4 class=\"a-spacing-mini\" style=\"text-align: center;\">OLED Display</h4>\r\n<p style=\"text-align: center;\">Movies, sports, games and more come to thrilling new life with the perfect black</p>\r\n<p style=\"text-align: center;\">and intense color of the LG OLED display. LG OLED TV with AI ThinQ uses the latest panels,</p>\r\n<p style=\"text-align: center;\">with brighter, self-illuminating pixels that truly deliver the Best. Picture. Ever.</p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/MMYvyAzt3wf5xjGkE1JVtKVC8gl81I7kBBhiSW70.jpeg\" alt=\"\" width=\"300\" height=\"300\" /></p>\r\n<h4 class=\"a-spacing-mini\" style=\"text-align: center;\">&nbsp;</h4>\r\n<h4 class=\"a-spacing-mini\" style=\"text-align: center;\">Premium Content Choices</h4>\r\n<p style=\"text-align: center;\">LG OLED TV with AI ThinQ features comprehensive support of major high dynamic range</p>\r\n<p style=\"text-align: center;\">formats including Dolby Vision HDR from the cinema, as well as HDR10 and HLG, both</p>\r\n<p style=\"text-align: center;\">with LG&rsquo;s advanced tone-mapping technology that provides scene-by-scene optimization.</p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/YSTEMW79mYCTppXrM8DQ3zNm5KJNH8pdRjN5Zyaj.jpeg\" alt=\"\" width=\"300\" height=\"300\" /></p>\r\n<h4 class=\"a-spacing-mini\" style=\"text-align: center;\">&nbsp;</h4>\r\n<h4 class=\"a-spacing-mini\" style=\"text-align: center;\">Cinematic Sound at Home with Dolby Atmos</h4>\r\n<p style=\"text-align: center;\">Dolby Atmos transports you with moving audio : crickets chirping all around,</p>\r\n<p style=\"text-align: center;\">a monster roaring from behind, or a plane soaring overhead. Dolby Atmos content creates a more</p>\r\n<p style=\"text-align: center;\">detailed sound experience that appears to come from everywhere for a wonderfully realistic,</p>\r\n<p style=\"text-align: center;\">immersive experience that puts you inside the story.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Description:</strong></p>\r\n<p>&nbsp;</p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">LG OLED TV with AI (Artificial Intelligence) ThinQ has the Google Assistant built in, so you can control compatible smart home devices using just your voice through the LG Magic Remote. Create a center for your smart home and beyond. Plus it works with Amazon Alexa devices (sold separately)</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">The &alpha;9 Intelligent Processor inside the LG OLED TV with AI ThinQ is the most powerful ever from LG. Developed exclusively for LG OLED TV, the new &alpha;9 processor noticeably enhances sharpness and depth while delivering vastly more accurate colors, for the ultimate in picture quality</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">Pixel Level Dimming enables each of the 8.3 million individually lit pixels of the LG OLED TV with AI ThinQ to brighten, dim or power off completely, achieving perfect black and displaying a level of picture detail impossible with any other television technology</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">4K Cinema HDR on LG OLED TV with AI ThinQ features comprehensive support of major high dynamic range formats including Dolby Vision, as well as HDR10 and HLG, both with LG&rsquo;s advanced tone-mapping technology that provides scene-by-scene optimization</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">Dolby Atmos is the same audio technology developed for state-of-the-art cinemas, with immersive sound that appears to come from everywhere, putting you in the middle of all the excitement</span></li>\r\n<li><span class=\"a-list-item\">LG OLED Display uses the latest panels, with brighter, self-illuminating pixels that deliver perfect black and intense color. LG OLED TV with AI ThinQ brings movies, sports, games and more to thrilling new life</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">Inputs: 4 HDMI, 3 USB, 1 RF, 1 Composite in, 1 Ethernet, 1 Optical, 1 RS232C (Mini Jack) and Audio Return Channel Support via HDMI</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Product information:</strong></p>\r\n<p>&nbsp;</p>\r\n<table id=\"productDetails_techSpec_section_1\" class=\"a-keyvalue prodDetTable\" style=\"height: 134px;\" role=\"presentation\">\r\n<tbody>\r\n<tr style=\"height: 20px;\">\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left; height: 20px; width: 149.875px;\">Brand Name</th>\r\n<td class=\"a-size-base\" style=\"height: 20px; width: 260.542px; text-align: right;\">LG</td>\r\n</tr>\r\n<tr style=\"height: 19px;\">\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left; height: 19px; width: 149.875px;\">Item Weight</th>\r\