 235.977px;\">Product Dimensions</th>\r\n<td class=\"a-size-base\" style=\"height: 20px; width: 195.977px; text-align: right;\">18.3 x 75.8 x 46.6 inches</td>\r\n</tr>\r\n<tr style=\"height: 20px;\">\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left; height: 20px; width: 235.977px;\">California residents</th>\r\n<td class=\"a-size-base\" style=\"height: 20px; width: 195.977px; text-align: right;\">for Proposition 65 warning</td>\r\n</tr>\r\n<tr style=\"height: 20px;\">\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left; height: 20px; width: 235.977px;\">Item model number</th>\r\n<td class=\"a-size-base\" style=\"height: 20px; width: 195.977px; text-align: right;\">86SM9070PUA</td>\r\n</tr>\r\n<tr style=\"height: 20px;\">\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left; height: 20px; width: 235.977px;\">Discontinued by manufacturer</th>\r\n<td class=\"a-size-base\" style=\"height: 20px; width: 195.977px; text-align: right;\">Yes</td>\r\n</tr>\r\n<tr style=\"height: 20px;\">\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left; height: 20px; width: 235.977px;\">Color Name</th>\r\n<td class=\"a-size-base\" style=\"height: 20px; width: 195.977px; text-align: right;\">Black</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>','LG a7 GEN 2 INTELLIGENT PROCESSOR: Images, action and color are brought to new life to instantly enhance picture quality through LG\'s best 4K processor, empowered by AI at its core.'),(86,86,'en','LG Electronics 75UH6550 75-Inch 4K Ultra HD Smart LED TV','<h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"text-align: center;\"><span id=\"productTitle\" class=\"a-size-large\">LG 75UH6550 75-Inch 4K Ultra HD Smart&nbsp; TV</span></h1>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-size-large\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/yxcHwXvFlF0kYCzLecFyErNEhwFow68T31aUdLUx.jpeg\" alt=\"\" width=\"679\" height=\"418\" /></span></p>\r\n<p>&nbsp;</p>\r\n<h3 class=\"a-spacing-mini\" style=\"text-align: center;\">Breathtaking clarity and fine picture detail that will amaze</h3>\r\n<p style=\"text-align: center;\">4K UHD Smart LED TV - 75\" Class (74.6\" Diag) - 75UH6550.</p>\r\n<p style=\"text-align: center;\"><strong>Key Features:</strong></p>\r\n<p style=\"text-align: center;\">- 8.3M Pixels for 4x the Resolution of Full HD TVs.</p>\r\n<p style=\"text-align: center;\">- webOS 3.0: A World of Entertainment Choices at Your Fingertips.</p>\r\n<p style=\"text-align: center;\">LG 4K Ultra HD TVs contain 8.3 million pixels, so their resolution is four times that of Full HD. The result? Breathtaking clarity and fine picture details that will amaze, even when viewed up close.</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><img style=\"float: left;\" src=\"/storage/media/cyLyeyxqiObCChRBMc74kUTnt65cFxS4tngXOflA.jpeg\" alt=\"\" width=\"220\" height=\"220\" />&nbsp; &nbsp; &nbsp; <img src=\"/storage/media/AEfIxPUkFBh9dCEJrwsNiSpVZ84XpzcBtBo3hxXH.jpeg\" alt=\"\" width=\"220\" height=\"220\" />&nbsp; &nbsp; &nbsp; <img style=\"float: right;\" src=\"/storage/media/rs1qi5XN1SvEGnxd3vqbWoa7Zc8ySGuIyE4vzQy5.jpeg\" alt=\"\" width=\"220\" height=\"220\" /></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<table style=\"border-collapse: collapse; width: 100%; margin-left: auto; margin-right: auto;\" border=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 33.3333%;\">\r\n<h4 class=\"a-spacing-mini\" style=\"text-align: left;\">4K UHD</h4>\r\n<p class=\"a-size-small\">Ultra high-definition TVs offer four times the resolution of Full HD televisions. UHD, also known as \'4K\', delivers exceptional clarity and detail for all video content.</p>\r\n</td>\r\n<td style=\"width: 33.3333%;\">\r\n<h4 class=\"a-spacing-mini\" style=\"text-align: center;\">Wide-Ranging Color</h4>\r\n<p class=\"a-size-small\">Color Prime Pro produces a wider range of colors for a more accurate, more lifelike picture that&rsquo;s enjoyable from a wider viewing angle.</p>\r\n</td>\r\n<td style=\"width: 33.3333%;\">\r\n<h4 class=\"a-spacing-mini\" style=\"text-align: right;\">TruMotion 120Hz</h4>\r\n<p class=\"a-size-small\">TruMotion 120Hz technology lets you see sports, video games and high-speed action with virtually no motion blur. Now your TV can keep up with your fast- moving.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/ZHHiYO5xiJ01IWVHUfXJR040brFp1uCm2xH1P5bQ.jpeg\" alt=\"\" width=\"220\" height=\"220\" /></p>\r\n<p>&nbsp;</p>\r\n<h4 class=\"a-spacing-mini\" style=\"text-align: center;\">webOS 3.0 Smart TV</h4>\r\n<p class=\"a-size-small\" style=\"text-align: center;\">The latest generation of LG\'s exclusive, award-winning Smart TV platform is incredibly easy to use with simple setup and content discovery.</p>\r\n<p class=\"a-size-small\" style=\"text-align: center;\">Disclaimer: Please check with content providers for required bandwidth to stream videos. Smart service on product is subject to change. Some apps that appear on the screen image may not be preinstalled; Internet connection is required for download.</p>\r\n<p class=\"a-size-small\" style=\"text-align: center;\">&nbsp;</p>\r\n<p class=\"a-size-small\" style=\"text-align: left;\"><strong>Details:</strong></p>\r\n<p>&nbsp;</p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">Refresh Rate: TruMotion 240Hz</span></li>\r\n<li><span class=\"a-list-item\">Backlight: LED</span></li>\r\n<li><span class=\"a-list-item\">Smart Functionality: Yes - 3.0</span></li>\r\n<li><span class=\"a-list-item\">Dimensions (W x H x D with stand): 66.2\" x 40.2\" x 13.4\"</span></li>\r\n<li><span class=\"a-list-item\">Inputs: 3 HDMI, 3 USB, 1 RF, 1 Component, 1 Composite, 1 Optical, 1 RS232C, 1 Ethernet</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p class=\"a-size-small\" style=\"text-align: left;\"><strong>Product Description:</strong></p>\r\n<p>&nbsp;</p>\r\n<table id=\"productDetails_techSpec_section_1\" class=\"a-keyvalue prodDetTable\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Brand Name</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">LG</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item Weight</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">103.2 pounds</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Product Dimensions</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">66.2 x 2.2 x 37.8 inches</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item model number</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">75UH6550</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Batteries</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">2 AAA batteries required. (included)</td>\r\n</tr>\r\n</tbody>\r\n</table>','The enhanced contrast and color of HDR Pro and Color Prime Pro go big with the UH6550 Series 4K UHD Smart LED TV. Images stay vibrant and cinematic, even at an angle thanks to IPS technology, at screen sizes up to 75-inch-class. And web OS 3.0 makes streaming 4K shows and movies easy and fun!'),(87,87,'en','LG OLED65CXPUA Alexa Built-in CX Series 65\" 4K Ultra HD Smart OLED TV','<h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"text-align: center;\"><span id=\"productTitle\" class=\"a-size-large\">LG Alexa Built-in 65\" 4K Ultra HD Smart OLED TV</span></h1>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-size-large\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/mvAaJUVURekJ7KdNUsRgEvR0ML1v2kbbIiSRVEaH.jpeg\" alt=\"\" width=\"679\" height=\"407\" /><br /></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 33.3333%;\">\r\n<h2 class=\"a-text-center premium-module-4-heading aplus-h1 a-text-bold\" style=\"text-align: center;\"><img src=\"/storage/media/s9RV2CoY5JM8hrnQQjIWifVTyZEY4qYHj4IIqYXs.jpeg\" alt=\"\" width=\"355\" height=\"258\" /></h2>\r\n</td>\r\n<td style=\"width: 33.3333%;\">\r\n<h2 class=\"a-text-center premium-module-4-heading aplus-h1 a-text-bold\" style=\"text-align: center;\"><img src=\"/storage/media/yfJEgQoQGZ9jkVQ3RIbHYb8zp0GP6CR2b97FwO6X.jpeg\" alt=\"\" width=\"91\" height=\"355\" /></h2>\r\n</td>\r\n<td style=\"width: 33.3333%;\">\r\n<h2 class=\"a-text-center premium-module-4-heading aplus-h1 a-text-bold\" style=\"text-align: center;\"><span class=\"a-size-large\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/EMSSU6oraCTvlPynsC9q4NlDPexYr2s8jRQrjsM1.jpeg\" alt=\"\" width=\"355\" height=\"220\" /></span></h2>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h2 class=\"a-text-center premium-module-4-heading aplus-h1 a-text-bold\" style=\"text-align: center;\"><span class=\"a-size-large\">&nbsp;</span></h2>\r\n<h2 class=\"a-text-center premium-module-4-heading aplus-h1 a-text-bold\" style=\"text-align: center;\">&nbsp;</h2>\r\n<h2 class=\"a-text-center premium-module-4-heading aplus-h1 a-text-bold\" style=\"text-align: center;\">OLED CX Features</h2>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/04z2dSrkhdOgFUcbLDA2wvlGGf6hBOswUtk09gJz.jpeg\" alt=\"\" width=\"651\" height=\"350\" /></p>\r\n<div class=\"a-section a-spacing-none column-heading\">\r\n<h1 class=\"aplus-h3 a-text-bold\">&nbsp;</h1>\r\n<h1 class=\"aplus-h3 a-text-bold\" style=\"text-align: center;\">See More of Your Content in 4K</h1>\r\n</div>\r\n<div class=\"a-section a-spacing-none column-description\">\r\n<p class=\"aplus-p3\" style=\"text-align: center;\">4K processor uses AI and deep learning to authentically upscale lower resolution</p>\r\n<p class=\"aplus-p3\" style=\"text-align: center;\">content, translating the source to 4K\'s 8.3+ million pixels. The technology is so good,</p>\r\n<p class=\"aplus-p3\" style=\"text-align: center;\">you might mistake non-4K for true 4K*.</p>\r\n<p class=\"aplus-p3\" style=\"text-align: center;\">*Image quality of upscaled content will vary based on the source resolution.</p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;<img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/2nKFBAEuUP3jez0hdkFolUxxws30AGduSb6T54nD.jpeg\" alt=\"\" width=\"651\" height=\"350\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<div class=\"a-section a-spacing-none column-heading\">\r\n<h1 class=\"aplus-h3 a-text-bold\" style=\"text-align: center;\">Cinematic Sight and Sound</h1>\r\n</div>\r\n<div class=\"a-section a-spacing-none column-description\">\r\n<p class=\"aplus-p3\" style=\"text-align: center;\">Dolby Vision IQ automatically adjusts picture settings depending on ambient</p>\r\n<p class=\"aplus-p3\" style=\"text-align: center;\">lighting conditions and content genres. Dolby Atmos puts you in the middle of</p>\r\n<p class=\"aplus-p3\" style=\"text-align: center;\">the action with multi-dimensional surround sound that seems to flow all around you.</p>\r\n<p class=\"aplus-p3\">&nbsp;</p>\r\n<p class=\"aplus-p3\">&nbsp;</p>\r\n<p class=\"aplus-p3\"><strong>Details:</strong></p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">LG OLED TV: Only OLED pixels emit their own light, allowing for perfect black, intense color and stunning picture.</span></li>\r\n<li><span class=\"a-list-item\">PIXEL LEVEL DIMMING: 8.3 million pixels control the light show. Millions of pixels emit their own light. Only OLED can turn pixels off completely and independently. See stunning picture, perfect black, infinite contrast and over a billion rich colors.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">WEBOS AND MAGIC REMOTE: LG\'s fan-favorite webOS platform makes it surprisingly fast and easy to stream movies and shows with your favorite apps and find new obsessions based on what you like. While our Magic Remote lives up to its name with voice and motion control &mdash; just speak or simply point, scroll and click.</span></li>\r\n<li><span class=\"a-list-item\">&alpha;9 GEN 3 AI PROCESSOR 4K: Everything you see and hear is automatically made better, clearer, smoother, and more dynamic with our a9 Gen 3 AI Processor 4K. You don&rsquo;t have to do a thing. Our most advanced 4K processor does it for you with AI Picture Pro, AI Sound Pro, AI 4K Upscaling, and the ability to help your TV to evolve over time.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">GAMING: LG OLED TV is built for gaming. AI-powered picture quality transports you to the moment. Gaming features and the latest tech, like NVIDIA G-SYNC and FreeSync, give you an edge with less lag, high refresh rates, and incredibly smooth and responsive gameplay.</span></li>\r\n<li><span class=\"a-list-item\">Connectivity Technology: Wireless</span></li>\r\n<li><span class=\"a-list-item\">Surround Sound Channel Configuration: 2.2</span></li>\r\n<li><span class=\"a-list-item\">Included Components: Power Cable, Remote Control, Stand</span></li>\r\n</ul>\r\n<p class=\"aplus-p3\">&nbsp;</p>\r\n<p class=\"aplus-p3\"><strong>Product Description:</strong></p>\r\n<table id=\"productDetails_techSpec_section_1\" class=\"a-keyvalue prodDetTable\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Brand Name</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">LG</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item Weight</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">71.9 pounds</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Product Dimensions</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">9.9 x 57 x 33.9 inches</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item model number</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">OLED65CXPUA</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Speaker Type</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">Built-In</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','LG OLED TV CX redefines everything you see. Once you’ve seen LG OLED TV, other TVs pale in comparison. OLED is a difference-maker for movies, shows, sports and gaming. From the gridiron to the iron throne, no detail goes unseen. And only OLED pixels emit their own light for perfect black, intense color and stunning picture.'),(88,88,'en','Sony X950G 55 Inch TV: 4K Ultra HD Smart LED TV','<h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"text-align: center;\"><span id=\"productTitle\" class=\"a-size-large\">Sony X950G 55 Inch TV: 4K Ultra HD Smart LED TV</span></h1>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-size-large\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/UIp4NApS5zOaHTnDBjOgJZTU5KUw9fKBwpZA424w.jpeg\" alt=\"\" width=\"1464\" height=\"600\" /></span></p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/F9j5YHzyhBVLIabSlt2KYTGD7sFyQ4XcjDTN1SXR.jpeg\" alt=\"\" width=\"1464\" height=\"600\" /></p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/D8gLflrTTrKLzi7O4pegiDzyzoeBK0kagzgbVRAy.jpeg\" alt=\"\" width=\"1464\" height=\"600\" /></p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/yjW4GLTExJ49uAjAmyX7IrEDVcvQewyt0CFRGrHt.jpeg\" alt=\"\" width=\"1464\" height=\"600\" /></p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/BTbXMiTjGlxosGiYIcMed8wRxzwbf5QjaAbIJXld.jpeg\" alt=\"\" width=\"1464\" height=\"600\" /></p>\r\n<h2>&nbsp;</h2>\r\n<p><strong>Details:</strong></p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">HIGH DYNAMIC RANGE: Experience incredible detail, brightness and clarity with 4K UHD resolution</span></li>\r\n<li><span class=\"a-list-item\">X-WIDE ANGLE: Sit anywhere in the room to enjoy incredible real-world color with the 85inch X950G</span></li>\r\n<li><span class=\"a-list-item\">IMMERSIVE AUDIO: Acoustic Multi-Audio syncs sound with action to create Sound-from Picture Reality</span></li>\r\n<li><span class=\"a-list-item\">ULTIMATE REALISM: Enjoy clear, vibrant colors with TRILUMINOS Display and 4K HDR Super Bit Mapping</span></li>\r\n<li><span class=\"a-list-item\">NO MOTION BLUR: Watch lifelike on-screen action with virtually no blur with Motion flow XR technology</span></li>\r\n<li><span class=\"a-list-item\">APPLE AIRPLAY 2 and HOMEKIT SUPPOR: Seamlessly integrate your iPhone and Siri devices with your Sony TV for effortless smart home management and content streaming.</span></li>\r\n<li><span class=\"a-list-item\">WORKS WITH ALEXA: Stream smart camera feeds with your voice. Through an Alexa enabled device, just ask Alexa to play music, launch video apps, turn up the volume, and more</span></li>\r\n</ul>\r\n<div class=\"a-row a-expander-container a-expander-inline-container\" aria-live=\"polite\">\r\n<div class=\"a-expander-content a-expander-extend-content a-expander-content-expanded\" aria-expanded=\"true\">\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">ANDROID TV: 55in flat screen TV with the Google Assistant built-in; Alexa and Google Home compatible.</span></li>\r\n<li><span class=\"a-list-item\">DIMENSIONS: TV with Stand: 48 3/8 x 30 5/8 x 10 7/8 Inch; Without Stand: 48 3/8 x 28 x 2 3/4 Inch</span></li>\r\n<li><span class=\"a-list-item\">IN THE BOX: 55 in TV, stand, remote, batteries, power cord, IR blaster, start Guide, and manual</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<div class=\"a-row\">\r\n<div class=\"a-column a-span6\">\r\n<p class=\"a-size-medium a-spacing-small\"><strong>Technical Details:</strong></p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n<div class=\"a-expander-content a-expander-extend-content\" aria-expanded=\"true\">\r\n<div class=\"a-row a-expander-container a-expander-inline-container\" aria-live=\"polite\">\r\n<div class=\"a-expander-content a-expander-section-content a-section-expander-inner\" aria-expanded=\"true\">\r\n<table id=\"productDetails_techSpec_section_1\" class=\"a-keyvalue prodDetTable\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Brand Name</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">Sony</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item Weight</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">41.9 pounds</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Product Dimensions</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">30.6 x 10.9 x 48.4 inches</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">California residents</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">&nbsp;for Proposition 65 warning</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item model number</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">XBR55X950G</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Batteries</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">2 AAA batteries required. (included)</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Color Name</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">Black</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>','HIGH DYNAMIC RANGE: Experience incredible detail, brightness and clarity with 4K UHD resolution\r\nX-WIDE ANGLE: Sit anywhere in the room to enjoy incredible real-world color with the 85inch X950G\r\nIMMERSIVE AUDIO: Acoustic Multi-Audio syncs sound with action to create Sound-from Picture Reality'),(89,89,'en','Sony XBR49X900F 49-Inch 4K Ultra HD Smart LED TV','<h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"text-align: center;\"><span id=\"productTitle\" class=\"a-size-large\">Sony 49-Inch 4K Ultra HD Smart LED TV&nbsp;</span></h1>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-size-large\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/nUxUp9Kdhykxxung66LVjGQlNmYs8Y9I8uVF7fFC.jpeg\" alt=\"\" width=\"1464\" height=\"600\" /></span></p>\r\n<p><span class=\"a-size-large\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/0iHG3Ka2EfY6u1ZMVdSnzLGOJp3vstWDLBE2M1EJ.j