PORTABLE: Use the detachable carry strap to hang, carry, or clip the speaker to your bag</span></li>\r\n<li><span class=\"a-list-item\">WATERPROOF CASING: Take to the pool or beach without worrying about water damaging the speaker unit</span></li>\r\n<li><span class=\"a-list-item\">TOTALLY DUSTPROOF: This outdoor pocket speaker will keep on playing no matter how dusty the surface</span></li>\r\n<li><span class=\"a-list-item\">UPGRADE THE AUDIO: Wirelessly connect 2 speakers and achieve stereo sound with Speaker Add Function</span></li>\r\n<li><span class=\"a-list-item\">LONGER BATTERY LIFE: Party for longer with this rechargeable speaker\'s extended 16 hour battery life</span></li>\r\n</ul>\r\n<div class=\"a-row a-expander-container a-expander-inline-container\" aria-live=\"polite\">\r\n<div class=\"a-expander-content a-expander-extend-content a-expander-content-expanded\" aria-expanded=\"true\">\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">COMPACT SIZE: Measures approx. 3&rdquo; in diameter and 3 5/8&rdquo; in height and only weighs approx. 8. 6 oz</span></li>\r\n<li><span class=\"a-list-item\">PLAY ANYWHERE: Full range speaker for use at home, in your car, on a bike, while hiking, and more</span></li>\r\n<li><span class=\"a-list-item\">IN THE BOX: Sony SRS-XB12 Bluetooth portable speaker with attached carry strap and USB charging cable</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h2>Product information</h2>\r\n<p><span class=\"a-list-item\">Color:<strong>Black</strong></span></p>\r\n<div class=\"a-row a-spacing-top-base\">\r\n<div class=\"a-column a-span6\">\r\n<div class=\"a-row a-spacing-base\">\r\n<div class=\"a-section table-padding\">\r\n<table id=\"productDetails_detailBullets_sections1\" class=\"a-keyvalue prodDetTable\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Product Dimensions</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">3.4 x 3.4 x 4.2 inches</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item Weight</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">8 ounces</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Shipping Weight</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">8 ounces&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">ASIN</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">B07P85CDHG</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item model number</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">SRSXB12/B</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Batteries</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">1 Lithium Polymer batteries required.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>','MUSIC THAT TRAVELS: Small size but mighty in volume to deliver powerful beats wherever you travel\r\nVIRTUAL HAPPY HOUR: Turn your virtual happy hour party into a dance party with EXTRA BASS, and pair two for even more fun'),(91,91,'en','LG LHD657 Bluetooth Multi Region Free 5.1-Channel Home Theater','<h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"text-align: center;\"><span id=\"productTitle\" class=\"a-size-large\">LG LHD657 Bluetooth 5.1-Channel Home Theater</span></h1>\r\n<p>&nbsp;</p>\r\n<p><strong><span class=\"a-size-large\">Details:</span></strong></p>\r\n<p>&nbsp;</p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">Region Free Home Theater System with PAL/NTSC Support. It Will Play All Your DVD\'s (Region 0-9) From Around The World. 110-240 Volt Worldwide Voltage</span></li>\r\n<li><span class=\"a-list-item\">Convenient and stylish sound has arrived. Enjoy a clean, elegant look in your living room, with easy and convenient installation. 1000 Watts of Power!</span></li>\r\n<li><span class=\"a-list-item\">Audio L/R Yes, Composing of channel 3, Composite Yes, Optical x1, HDMI Output x1, Terminal Type Push in (Spring), Bluetooth, Karaoke, FREE HDMI CABLE INSIDE</span></li>\r\n<li><span class=\"a-list-item\">With the LG Home Theater System, Micro and Mini Audio you can not only play files stored on USB devices, but record CD tracks or FM radio programs on your USB, while listening at the same time</span></li>\r\n<li><span class=\"a-list-item\">Enjoy your favorite music stored on mobile devices through the LG sound system with wireless audio streaming via Bluetooth enjoy LG Audio\'s karaoke function at anytime.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Product information:</strong></p>\r\n<div class=\"a-row a-spacing-top-base\">\r\n<div class=\"a-column a-span6\">\r\n<div class=\"a-row a-spacing-base\">\r\n<div class=\"a-section table-padding\">\r\n<table id=\"productDetails_detailBullets_sections1\" class=\"a-keyvalue prodDetTable\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Product Dimensions</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">35 x 21 x 17 inches</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item Weight</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">50 pounds</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Shipping Weight</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">57 pounds</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Manufacturer</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">LG</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">ASIN</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">B01KZTIHI2</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item model number</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">LHD657</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Batteries</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">2 AAA batteries required. (included)</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','Region Free Home Theater System with PAL/NTSC Support. It Will Play All Your DVD\'s (Region 0-9) From Around The World. 110-240 Volt Worldwide Voltage'),(92,92,'en','Polk 5.1 Channel 4K 3D A/V Surround Sound Multimedia Home Theater','<h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"text-align: center;\"><span id=\"productTitle\" class=\"a-size-large\">Polk 5.1 Surround Sound Multimedia Home Theater</span></h1>\r\n<p>&nbsp;</p>\r\n<p class=\"default\"><strong>Product description:</strong></p>\r\n<div id=\"productDescription\" class=\"a-section a-spacing-small\">\r\n<p><strong>Polk 5.1-channel Home Theater Speaker Set</strong><br /><br />The 5.1-channel Polk speaker package is the perfect addition to your DVD player and home theater receiver. It features 2-way bass reflex front, center and surround speakers that provide an excellent soundstage with 3-Way 4-Driver Floor-Standing Speakers, 100 watt 3-Way Bookshelf Speakers, 2-Way 145 watt Center Channel Speaker plus an earth-shaking 115W 10\" Active powered subwoofer for rumbling impact.</p>\r\n<p><br /><strong>Polk 2-Way Floor-Standing Speaker (Pair)</strong><br /><br />2-Way Speaker Design<br />150W Peak Power<br />Dual 6 1/2&rdquo; Graphite injected polymer woofer<br />1&rdquo; Kortec Soft Dome Tweeter<br />6 ohms Speaker Impedance<br />Dimensions (H x W x D) 36.5 x 9.25 x 8.75&rdquo;</p>\r\n<p><br /><br /><strong>Polk 2-Way Bookshelf Speaker System</strong><br /><br />2-Way Bass Reflex Design<br />6-1/2\" Graphite injected polymer woofer<br />1&rdquo; (25mm) Kortec Soft Dome tweeters<br />150 watts music power<br />8 ohms Speaker Impedance<br />Dimensions (H x W x D) 10.63 x 6.5&rdquo; x 7.25&rdquo;</p>\r\n<p><br /><br /><strong>Polk 2-Way Center Channel Speaker</strong><br /><br />Two-way Acoustic Suspension Design<br />Dual 5-1/4\" Woofers<br />1&rdquo; Kortec Soft Dome tweeters<br />100 Watts Music Power<br />6 ohms Speaker Impedance<br />Dimensions (H x W x D) 6.5 x 19 x 8.5&rdquo;</p>\r\n<p><br /><br /><strong>Polk 10\" Active Subwoofer</strong><br /><br />10\" Woofer<br />100W Peak Power<br />Graphite injected polymer woofers<br />Patented BassTrac circuitry reduces fuzziness and distortion<br />Dimensions (H x W x D) 14.3 x 14 x 16</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Product information:</strong></p>\r\n<div class=\"a-row a-spacing-top-base\">\r\n<div class=\"a-column a-span6\">\r\n<div class=\"a-row a-spacing-base\">\r\n<div class=\"a-section table-padding\">\r\n<table id=\"productDetails_detailBullets_sections1\" class=\"a-keyvalue prodDetTable\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Shipping Weight</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">150 pounds</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Manufacturer</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">Polk</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">ASIN</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">B079ZBHPFD</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n</div>','Compact and powerful - Enhance your TV experience with rich, dynamic sound of the Polk Surround Sound Multimedia Home Theater Speaker System\r\nPolk 2-Way Floor-Standing Speakers (Pair)'),(93,93,'en','Bose SoundSport, Wireless Earbuds, (Sweatproof Bluetooth Headphones)','<h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"text-align: center;\"><span id=\"productTitle\" class=\"a-size-large\">Bose SoundSport, Wireless Earbuds</span></h1>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-size-large\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/1QTwUWAaA36Tgw9LgWaI2fApRHzve9N6MJ3HjDMl.jpeg\" alt=\"\" width=\"1464\" height=\"600\" /></span></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><span class=\"a-size-large\"><iframe src=\"https://www.youtube.com/embed/szTXcgsGlNI\" width=\"640\" height=\"360\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/P9j8oj9bzXHDW8Yx0JJLvxXRDavjhG3CKACKXlSD.jpeg\" alt=\"\" width=\"1464\" height=\"600\" /></p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/sRpYNFVfiaOcwp5AfLxW2zmp1sAs6AEXnM8IlW4i.jpeg\" alt=\"\" width=\"800\" height=\"600\" /></p>\r\n<p>&nbsp;</p>\r\n<h1 class=\"aplus-h1 aplus-module-1-heading a-text-bold\" style=\"text-align: center;\">Nothing to lose.</h1>\r\n<p class=\"aplus-p2 aplus-module-1-description\" style=\"text-align: center;\">The Bose Connect app makes it easier to connect and switch between devices.</p>\r\n<p class=\"aplus-p2 aplus-module-1-description\" style=\"text-align: center;\">Personalize your settings so you can power your workout quickly and easily.</p>\r\n<p class=\"aplus-p2 aplus-module-1-description\" style=\"text-align: center;\">Tile makes it easy to find your headphones if they ever go missing.</p>\r\n<p class=\"aplus-p2 aplus-module-1-description\" style=\"text-align: center;\">Use the Bose Connect app to update your headphones&rsquo; software, then download</p>\r\n<p class=\"aplus-p2 aplus-module-1-description\" style=\"text-align: center;\">the Tile app and follow the instructions. And you&rsquo;ll never lose your music.</p>\r\n<p class=\"aplus-p2 aplus-module-1-description\" style=\"text-align: center;\">&nbsp;</p>\r\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 50%;\"><img src=\"/storage/media/NQjdR4HjIY5AmPvqfLvzffY26VKU1X2fMVQG8Rnh.jpeg\" alt=\"\" width=\"800\" height=\"600\" /></td>\r\n<td style=\"width: 50%;\">\r\n<h1 class=\"aplus-h1 aplus-module-1-heading a-text-bold\" style=\"text-align: center;\">The only challenge left is your workout.</h1>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p class=\"default\"><strong>Product description:</strong></p>\r\n<div id=\"productDescription\" class=\"a-section a-spacing-small\">\r\n<div class=\"disclaim\">Color:<strong>Black</strong></div>\r\n<p>With no wires in the way, Bose Sound Sport wireless headphones keep you moving with powerful audio and Stay Hear+ tips designed for comfort and stability. A soft silicone material and unique shape provide a secure fit that stays put and feels good. Connect to your device easily with Bluetooth and NFC pairing, and use the inline mic and remote to control volume, skip tracks and take calls.</p>\r\n<p>With the Bose Connect app, controlling and switching between multiple devices is easy. These headphones are sweat and weather resistant and have a lithium ion battery that delivers up to 6 hours per charge. With performance like this, the only challenge left is your workout.</p>\r\n<p>Included: Sound Sport wireless headphones; Stay Hear+ tips; USB charging cable; carry case. Allow up to two hours to fully charge the battery. A full charge powers the headphones for up to six hours. The headphones will not play while charging.</p>\r\n<p>Note: Before charging, be sure the headphones are at room temperature between 41 degree Fahrenheit (5 degree Celsius ) and 104 degree Fahrenheit (40 degree Celsius ). &ldquo;Made for iPod,&rdquo; &ldquo;Made for iPhone,&rdquo; and &ldquo;Made for iPad&rdquo; mean that an electronic accessory has been designed to connect specifically to iPod, iPhone, or iPad, respectively, and has been certified by the developer to meet Apple performance standards.</p>\r\n<p>Apple is not responsible for the operation of this device or its compliance with safety and regulatory standards. Please note that the use of this accessory with iPod, iPhone or iPad may affect wireless performance</p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p><strong>Product information:</strong></p>\r\n<p><span class=\"a-size-large\">Color:<strong>Black</strong></span></p>\r\n<div class=\"a-row a-spacing-top-base\">\r\n<div class=\"a-column a-span6\">\r\n<div class=\"a-row a-spacing-base\">\r\n<div class=\"a-section table-padding\">\r\n<table id=\"productDetails_detailBullets_sections1\" class=\"a-keyvalue prodDetTable\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Product Dimensions</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">1 x 1.2 x 1.2 inches</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item Weight</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">0.8 ounces</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Shipping Weight</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">12.6 ounces</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">ASIN</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">B01L7PSJFO</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item model number</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">761529-0010</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Batteries</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">1 Lithium Metal batteries required. (included)</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>','A high quality audio experience, consistently balanced at any volume, thanks to Bose active EQ. Connectivity Technology: Wireless\r\nWireless convenience, with easy Bluetooth and NFC pairing aided by voice prompts\r\nExclusive Stay Hear and tips keep the headphones comfortably in place during workouts'),(94,94,'en','Powerbeats3 Wireless In-Ear Headphones - Black','<h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"text-align: center;\"><span id=\"productTitle\" class=\"a-size-large\">Powerbeats3 Wireless In-Ear Headphones - Black</span></h1>\r\n<p>&nbsp;</p>\r\n<div id=\"descriptionAndDetails\" class=\"a-section a-spacing-extra-large\">\r\n<div id=\"productDescription_feature_div\" class=\"celwidget\" data-feature-name=\"productDescription\" data-cel-widget=\"productDescription_feature_div\">\r\n<div id=\"productDescription_feature_div\" class=\"a-row feature\" data-feature-name=\"productDescription\" data-template-name=\"productDescription\" data-cel-widget=\"productDescription_feature_div\">\r\n<p class=\"default\"><strong>Product description:</strong></p>\r\n<div id=\"productDescription\" class=\"a-section a-spacing-small\">\r\n<p>In-Ear Stereo Headphones, Connect via Class 1 Bluetooth with your device for wireless workout freedom, Includes 4 sets of eartips, case and Micro USB charging cable</p>\r\n<p>Up to 12 hours of battery life to power through multiple workouts, With Fast Fuel, a 5-minute charge gives you 1 hour of playback when battery is low, Sweat and water resistance to handle tough training</p>\r\n<p>Take calls, control your music and activate Siri with RemoteTalk, Rechargeable Lithium-Ion battery</p>\r\n<p>Simultaneously connect to your Apple Watch, iPad and Mac (requires iCloud account and macOS Sierra, iOS 10, or watchOS 3)</p>\r\n<p>Flexible, secure-fit earhooks maximize comfort and stability, Dynamic, high-performance sound pushes you to the next level</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Product information:</strong></p>\r\n<div class=\"a-row a-spacing-top-base\">\r\n<div class=\"a-column a-span6\">\r\n<div class=\"a-row a-spacing-base\">\r\n<div class=\"a-section table-padding\">\r\n<table id=\"productDetails_detailBullets_sections1\" class=\"a-keyvalue prodDetTable\" style=\"width: 504px;\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"width: 156.542px; text-align: left;\">Product Dimensions</th>\r\n<td class=\"a-size-base\" style=\"width: 317.875px; text-align: right;\">8.3 x 2.5 x 2.7 inches</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"width: 156.542px; text-align: left;\">Item Weight</th>\r\n<td class=\"a-size-base\" style=\"width: 317.875px; text-align: right;\">3.52 ounces</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"width: 156.542px; text-align: left;\">Shipping Weight</th>\r\n<td class=\"a-size-base\" style=\"width: 317.875px; text-align: right;\">5.6 ounces&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"width: 156.542px; text-align: left;\">Manufacturer</th>\r\n<td class=\"a-size-base\" style=\"width: 317.875px; text-align: right;\">Beats</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"width: 156.542px; text-align: left;\">ASIN</th>\r\n<td class=\"a-size-base\" style=\"width: 317.875px; text-align: right;\">B06X979GGB</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"width: 156.542px; text-align: left;\">California residents</th>\r\n<td class=\"a-size-base\" style=\"width: 317.875px; text-align: right;\">&nbsp;for Proposition 65 warning</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"width: 156.542px; text-align: left;\">Item model number</th>\r\n<td class=\"a-size-base\" style=\"width: 317.875px; text-align: right;\">ML8V2LL/A</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"width: 156.542px; text-align: left;\">Batteries</th>\r\n<td class=\"a-size-base\" style=\"width: 317.875px; text-align: right;\">1 Lithium ion batteries required.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div id=\"renewedProgramDescriptionBtf_feature_div\" class=\"celwidget\" data-feature-name=\"renewedProgramDescriptionBtf\" data-cel-widget=\"renewedProgramDescriptionBtf_feature_div\"></div>','Up to 12 hours of battery life to power through multiple workouts\r\nWith Fast Fuel, a 5-minute charge gives you 1 hour of playback when battery is low'),(95,95,'en','Beats Solo3 Wireless On-Ear Headphones - Apple W1 Headphone Chip, Class 1 Bluetooth','<h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"text-align: center;\"><span id=\"productTitle\" class=\"a-size-large\">Beats Solo3 Wireless On-Ear Headphones</span></h1>\r\n<h1 class=\"a-size-large a-spacing-none\" style=\"text-align: center;\">&nbsp;</h1>\r\n<h1 class=\"a-size-large a-spacing-none\" style=\"text-align: center;\"><span id=\"productTitle\" class=\"a-size-large\"