ity Headset&nbsp;</span></h1>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-size-large\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/vurPdV9sqG1xj3p8kJMpdTcfhLbtF2Z3CsiXRtbv.jpeg\" alt=\"\" width=\"475\" height=\"292\" /></span></p>\r\n<h4 class=\"default\">Product description:</h4>\r\n<div id=\"productDescription\" class=\"a-section a-spacing-small\">\r\n<p>Slide your smartphone into the EVO Next Virtual Reality Headset (Black) and let the adventures begin. Dive into a 3D interactive game, your own home theater or explore the globe. It is lightweight and surprisingly comfortable and provides hours of uninterrupted escape.</p>\r\n<p>&nbsp;</p>\r\n<h4>Product information:</h4>\r\n<div class=\"a-row a-spacing-top-base\">\r\n<div class=\"a-column a-span6\">\r\n<div class=\"a-row a-spacing-base\">\r\n<div class=\"a-section table-padding\">\r\n<table id=\"productDetails_detailBullets_sections1\" class=\"a-keyvalue prodDetTable\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Product Dimensions</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">7.87 x 4.33 x 5.12 inches</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item Weight</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">1.15 pounds</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">ASIN</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">B01JBQ1EUI</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">UNSPSC Code</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">52160000</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Item model number</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">4336701501</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>','Slide your smartphone into the EVO Next Virtual Reality Headset (Black) and let the adventures begin. Dive into a 3D interactive game, your own home theater or explore the globe. It is lightweight and surprisingly comfortable and provides hours of uninterrupted escape.'),(122,122,'en','Oculus Rift S PC-Powered VR Gaming Headset','<h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"text-align: center;\"><span id=\"productTitle\" class=\"a-size-large\">Oculus Rift S PC-Powered VR Gaming Headset</span></h1>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-size-large\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/1ARMUzSfLl5OgTg5kjkvz85dJQfqKlavd2hmQ9w6.jpeg\" alt=\"\" width=\"1464\" height=\"600\" /></span></p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-size-large\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/LNitFUHC8GPLu3TtXHYrvwYFDUFW1eoh8I1J0kus.jpeg\" alt=\"\" width=\"1464\" height=\"600\" /></span></p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-size-large\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/ekLjQe3FD2y6pxAoekVRVyWgUk61MkiZtvgfCTpf.jpeg\" alt=\"\" width=\"1464\" height=\"600\" /></span></p>\r\n<h4>&nbsp;</h4>\r\n<h4><span class=\"a-size-large\">Details:</span></h4>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">Top VR gaming library: Blast, slash and soar your way through the top library in VR gaming. Oculus Rift S lets you play hundreds of games and exclusives already available in the Oculus store, with so much more to come.</span></li>\r\n<li><span class=\"a-list-item\">Improved optics: Stare down the competition with next-generation lenses and a sharper display. Improved optics deliver bright, vivid colors and reduced &ldquo;screen-door&rdquo; effect.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">Ergonomic design: keep your head in the game thanks to a Halo headband redesigned with speed in mind. Rift S stays securely and comfortably in place with a quick twist of the Fit wheel, so it can take-or double take-your fastest reactions.</span></li>\r\n<li><span class=\"a-list-item\">Oculus touch controllers: arm yourself with our updated Oculus touch controllers. Your slashes, throws and grab appear in VR with intuitive, realistic Precision, transporting your hands and gestures right into the game.</span></li>\r\n<li><span class=\"a-list-item\">Oculus insight tracking: take a step forward with Oculus insight. It translates your movements into VR No matter which way you\'re facing and provides room-scale tracking without external Sensors.</span></li>\r\n</ul>\r\n<h4>&nbsp;</h4>\r\n<h4><span class=\"a-list-item\">Product Description:</span></h4>\r\n<table id=\"productDetails_detailBullets_sections1\" class=\"a-keyvalue prodDetTable\" style=\"height: 411px;\" role=\"presentation\">\r\n<tbody>\r\n<tr style=\"height: 19px;\">\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"height: 19px; width: 211.208px; text-align: left;\">ASIN</th>\r\n<td class=\"a-size-base\" style=\"height: 19px; width: 531.208px; text-align: right;\">B07PTMKYS7</td>\r\n</tr>\r\n<tr style=\"height: 19px;\">\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"height: 19px; width: 211.208px; text-align: left;\">Release date</th>\r\n<td class=\"a-size-base\" style=\"height: 19px; width: 531.208px; text-align: right;\">May 21, 2019</td>\r\n</tr>\r\n<tr style=\"height: 19px;\">\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"height: 19px; width: 211.208px; text-align: left;\">Return Policy</th>\r\n<td style=\"height: 19px; width: 531.208px; text-align: right;\">\r\n<div class=\"a-section\">This product is non-returnable and non-refundable.</div>\r\n</td>\r\n</tr>\r\n<tr style=\"height: 19px;\">\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"height: 19px; width: 211.208px; text-align: left;\">Language:</th>\r\n<td class=\"a-size-base\" style=\"height: 19px; width: 531.208px; text-align: right;\">English</td>\r\n</tr>\r\n<tr style=\"height: 19px;\">\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"height: 19px; width: 211.208px; text-align: left;\">Product Dimensions</th>\r\n<td class=\"a-size-base\" style=\"height: 19px; width: 531.208px; text-align: right;\">10.94 x 6.3 x 8.27 inches; 1.87 pounds</td>\r\n</tr>\r\n<tr style=\"height: 19px;\">\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"height: 19px; width: 211.208px; text-align: left;\">Item model number</th>\r\n<td class=\"a-size-base\" style=\"height: 19px; width: 531.208px; text-align: right;\">301-00178-01</td>\r\n</tr>\r\n<tr style=\"height: 40px;\">\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"height: 40px; width: 211.208px; text-align: left;\">Is Discontinued By Manufacturer</th>\r\n<td class=\"a-size-base\" style=\"height: 40px; width: 531.208px; text-align: right;\">No</td>\r\n</tr>\r\n<tr style=\"height: 19px;\">\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"height: 19px; width: 211.208px; text-align: left;\">Item Weight</th>\r\n<td class=\"a-size-base\" style=\"height: 19px; width: 531.208px; text-align: right;\">1.87 pounds</td>\r\n</tr>\r\n<tr style=\"height: 19px;\">\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"height: 19px; width: 211.208px; text-align: left;\">Manufacturer</th>\r\n<td class=\"a-size-base\" style=\"height: 19px; width: 531.208px; text-align: right;\">Oculus</td>\r\n</tr>\r\n<tr style=\"height: 19px;\">\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"height: 19px; width: 211.208px; text-align: left;\">UNSPSC Code</th>\r\n<td class=\"a-size-base\" style=\"height: 19px; width: 531.208px; text-align: right;\">52160000</td>\r\n</tr>\r\n<tr style=\"height: 19px;\">\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"height: 19px; width: 211.208px; text-align: left;\">Batteries</th>\r\n<td class=\"a-size-base\" style=\"height: 19px; width: 531.208px; text-align: right;\">2 AA batteries required. (included)</td>\r\n</tr>\r\n<tr style=\"height: 19px;\">\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"height: 19px; width: 211.208px; text-align: left;\">Date First Available</th>\r\n<td class=\"a-size-base\" style=\"height: 19px; width: 531.208px; text-align: right;\">March 18, 2019</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','Top VR gaming library: Blast, slash and soar your way through the top library in VR gaming. Oculus Rift S lets you play hundreds of games and exclusives already available in the Oculus store, with so much more to come.'),(123,123,'en','Oculus Quest All-in-one VR Gaming Headset – 128GB','<h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"text-align: center;\"><span id=\"productTitle\" class=\"a-size-large\">Oculus Quest All-in-one VR Gaming Headset</span></h1>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-size-large\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/o0aUZIxQcnxmsjf6U7Dh8FXS42uz5tyBlPBaUlHK.jpeg\" alt=\"\" width=\"1464\" height=\"600\" /></span></p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-size-large\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/8ipaOEeAIABFxuRFHicP6NB8rUwQ8XUM8bGSI60m.jpeg\" alt=\"\" width=\"1464\" height=\"600\" /></span></p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-size-large\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/kBBgqdJB0wWfAWoTEy1JNFegYTdb5KtrIcAFr8Im.jpeg\" alt=\"\" width=\"1464\" height=\"600\" /></span></p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-size-large\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/oBMmyV47zZMQlj3D86s52KdUgEzDgz1gcym6j5wg.jpeg\" alt=\"\" width=\"1464\" height=\"600\" /></span></p>\r\n<h4>&nbsp;</h4>\r\n<h4><span class=\"a-size-large\">Product Details:</span></h4>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">All-in-one VR: No PC. No wires. No limits. Oculus Quest is an all-in-one gaming system built for virtual reality. Now you can play almost anywhere with just a VR headset and controllers.</span></li>\r\n<li><span class=\"a-list-item\">Oculus Touch Controllers: Arm yourself with the award-winning Oculus Touch controllers. Your slashes, throws and grabs appear in VR with intuitive, realistic precision, transporting your hands and gestures right into the game</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">Easy set up: The world is your arcade. Set up is easy whether you\'re at home or someplace new. Oculus Quest works with your environment, so you can play standing or sitting in spaces big or small.</span></li>\r\n<li><span class=\"a-list-item\">Incredible VR Games: Stop watching games and step into them. Whether you\'re dodging spells or slashing through enemy hordes, you\'ve never been this close to the action.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">Guardian Helps Keep You Safe: Explore the universe without tripping over the coffee table. The Oculus Guardian system is designed to help you avoid nearby objects while you\'re in-game.</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h4>Product information:</h4>\r\n<p><span class=\"a-list-item\">Edition:<strong>128GB</strong></span></p>\r\n<div class=\"a-row a-sp