st a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">This Certified Refurbished product is tested and certified to look and work like new. The refurbishing process includes functionality testing, basic cleaning, inspection, and repackaging. The product ships with all relevant accessories, a minimum 90-day warranty, and may arrive in a generic box. Only select sellers who maintain a high performance bar may offer Certified Refurbished products on Amazon.com</span></li>\r\n<li><span class=\"a-list-item\">3.4GHz quad-core Intel Core i7 (Turbo Boost up to 3.9GHz)</span></li>\r\n<li><span class=\"a-list-item\">16GB of 1600MHz DDR3 memory user-accessible SO-DIMM</span></li>\r\n<li><span class=\"a-list-item\">1TB (7200-rpm) hard drive, NVIDIA GeForce GTX 675MX graphics processor with 1GB of GDDR5 memory</span></li>\r\n<li><span class=\"a-list-item\">Stereo speakers, Dual microphones, Headphone port. 802.11n Wi-Fi wireless networking;2 IEEE 802.11a/b/g compatible</span></li>\r\n</ul>\r\n<h4>&nbsp;</h4>\r\n<h4><span class=\"a-list-item\">Technical Details:</span></h4>\r\n<table id=\"productDetails_techSpec_section_1\" class=\"a-keyvalue prodDetTable\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Screen Size</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">27 inches</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Processor</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">3.4 GHz core_i7</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">RAM</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">16 GB ddr3_sdram</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Hard Drive</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">1 TB mechanical_hard_drive</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Graphics Coprocessor</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">NVIDIA GeForce GTX 675MX</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Card Description</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">Dedicated</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Wireless Type</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">802.11ab</td>\r\n</tr>\r\n</tbody>\r\n</table>','3.4GHz quad-core Intel Core i7 (Turbo Boost up to 3.9GHz)\r\n16GB of 1600MHz DDR3 memory user-accessible SO-DIMM\r\n1TB (7200-rpm) hard drive, NVIDIA GeForce GTX 675MX graphics processor with 1GB of GDDR5 memory'),(125,125,'en','Apple iMac Pro 27\" with 5K Retina Display','<h1 class=\"default\" style=\"text-align: center;\">Apple iMac Pro 27\" with 5K Retina Display</h1>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/93J8ZQDfSCJrYqsoK3RT54GYS7fnIoboiwxbHQLa.jpeg\" alt=\"\" width=\"499\" height=\"419\" /></p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/6m272OVdVzgWeqAzM5RhHpSSXg7X1vCMyFhz8pHu.jpeg\" alt=\"\" width=\"499\" height=\"412\" /></p>\r\n<h2 class=\"default\">&nbsp;</h2>\r\n<h4 class=\"default\">Product description:</h4>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">Apple 27\" iMac Pro with Retina 5K Display (Late 2017) - Magic Keyboard with Numeric Keypad (Space Gray) - Magic Mouse 2 (Space Gray) - Lightning to USB Cable - Power Cord - Apple 1 Year Warranty (90 Days Technical Support)</span></li>\r\n<li><span class=\"a-list-item\">Operating System: macOS</span></li>\r\n<li><span class=\"a-list-item\">Processor: Intel Xeon W 10-Core 3.0GHz (turbo 4.5GHz) 23.75MB cache</span></li>\r\n<li><span class=\"a-list-item\">Memory: 64GB DDR4 SDRAM 2666 MHz ECC</span></li>\r\n<li><span class=\"a-list-item\">Available Memory Slots: None</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<div id=\"productDescription\" class=\"a-section a-spacing-small\">\r\n<p>The vision is brighter than ever A desktop experience that draws you in and keeps you there. This is the idea behind today\'s iMac. And now that idea is more powerful than ever. The new iMac is packed with all-new processors, the latest graphics technologies, innovative storage and higher-bandwidth connectivity. And it all comes to life on the brightest and most colorful Retina display iMac has ever seen.</p>\r\n<p>&nbsp;</p>\r\n<p>So you get an even more immersive experience - and a scintillating new way to take it all in. Performance - Think fast - We did Performance boosts across the board Faster and more powerful than ever, iMac is now equipped with Xeon processor and the latest high-performance graphics. Graphics that render you speechless iMac features powerful new AMD Radeon Pro Vega 64 graphics that make a spectacle of everything you see. The 27-inch iMac with Retina 5K display is loaded with up to 8GB of dedicated VRAM.</p>\r\n<p>&nbsp;</p>\r\n<p>It delivers visual effects and 3D graphics that exhibit raw power in its most polished form. On top of that, you get advanced video editing capabilities. Now you can edit multicam projects in Final Cut Pro X with up to five streams of full-resolution 4K video. Accelerate your every move An all-new Intel Xeon W 8-Core Intel Core processor in your iMac. It\'s more speed than iMac has ever reached before. And Turbo Boost gives you even more power when you\'re using processor-intensive applications like L.</p>\r\n<h4>&nbsp;</h4>\r\n<h4>Technical Details:</h4>\r\n<table id=\"productDetails_techSpec_section_1\" class=\"a-keyvalue prodDetTable\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Screen Size</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">27 inches</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Processor</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">intel_xeon</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">RAM</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">64 GB</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Hard Drive</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">1 TB flash_memory_solid_state</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Card Description</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">Dedicated</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>','Apple 27\" iMac Pro with Retina 5K Display (Late 2017) - Magic Keyboard with Numeric Keypad (Space Gray) - Magic Mouse 2 (Space Gray) - Lightning to USB Cable - Power Cord - Apple 1 Year Warranty (90 Days Technical Support)'),(126,126,'en','Apple iMac ME089LL/A 27in Intel Core i7-4771 3.5GHz','<h1 id=\"title\" class=\"a-size-large a-spacing-none\" style=\"text-align: center;\"><span id=\"productTitle\" class=\"a-size-large\">Apple iMac&nbsp; 27in Intel Core i7-4771 3.5GHz</span></h1>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-size-large\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/xsrLAl9mgVgbJEtgFtgCwOqELl3NP0tOFr8O0LSf.jpeg\" alt=\"\" width=\"679\" height=\"571\" /></span></p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"a-size-large\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/q33G4DjIwJxsJi4qTqpJ1Ybe7u1UrR3Dva1MVRiU.jpeg\" alt=\"\" width=\"515\" height=\"450\" /></span></p>\r\n<p>&nbsp;</p>\r\n<div id=\"descriptionAndDetails\" class=\"a-section a-spacing-extra-large\">\r\n<div id=\"productDescription_feature_div\" class=\"celwidget\" data-feature-name=\"productDescription\" data-cel-widget=\"productDescription_feature_div\">\r\n<div id=\"productDescription_feature_div\" class=\"a-row feature\" data-feature-name=\"productDescription\" data-template-name=\"productDescription\" data-cel-widget=\"productDescription_feature_div\">\r\n<h4 class=\"default\">Product description:</h4>\r\n<ul class=\"a-unordered-list a-vertical a-spacing-none\">\r\n<li><span class=\"a-list-item\">Intel Core i7-4771 3.5GHz; 1000GB SATA; 16GB DDR3</span></li>\r\n<li><span class=\"a-list-item\">27\" LED; 2560 x 1440; NVIDIA GeForce GTX 775M</span></li>\r\n<li><span class=\"a-list-item\">All-in-One; No Optical Drive; Apple Mac OS X 10.8</span></li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<div id=\"productDescription\" class=\"a-section a-spacing-small\">\r\n<p>Creating the stunningly thin design of the iMac took some equally stunning feats of technological innovation. Apple refined, re-imagined, or re-engineered everything about it from the inside out. The result is an elegant all-in-one computer that\'s as much a work of art as it is state of the art.</p>\r\n<p>&nbsp;</p>\r\n<p>With Intel Core i5 processor, Thunderbolt, and groundbreaking storage options, the slimmest iMac yet is also the most powerful. OS X makes every Mac intuitive and easy to use.</p>\r\n<h4>&nbsp;</h4>\r\n<h4>Technical Details:</h4>\r\n<table id=\"productDetails_techSpec_section_1\" class=\"a-keyvalue prodDetTable\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base prodDetSectionEntry\" style=\"text-align: left;\">Screen Size</th>\r\n<td class=\"a-size-base\" style=\"text-align: right;\">27 inches</td>\r\n</tr>\r\n<tr>\r\n<th class=\"a-color-secondary a-size-base p