e; width: 100%;\" border=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 50%;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/4LL8YLGdHjUGpDTi7CmG3MWyOli7wgIXANhDWTdA.jpeg\" alt=\"\" width=\"220\" height=\"220\" /></td>\r\n<td style=\"width: 50%;\">\r\n<h4 class=\"a-spacing-mini\">Superior Material</h4>\r\n<p class=\"a-size-small\">Beautiful jewelry starts with quality materials. Each Peora gemstone is hand-picked from the finest rough material that is meticulously selected for color hue and saturation. This means every piece of Peora jewelry contains stones that display vibrant color adding to the beauty of the piece.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 50%;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/SxrkxEihzhJcnW1rEcYf8BvWGALpkIjYSfhoQbQE.jpeg\" alt=\"\" width=\"220\" height=\"220\" /></td>\r\n<td style=\"width: 50%;\">\r\n<h4 class=\"a-spacing-mini\">Precision Cutting</h4>\r\n<p class=\"a-size-small\">With experience that span generations, our stone cutters lay each facet with mathematical precision capturing the dance of light within. Every curve and angle are purposefully cut resulting in an extraordinary display of brilliance you can experience.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 50%;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/storage/media/ZiWKTF2mnNTZwUXoUgzXBFKEAS78K97n5lBIeBQa.jpeg\" alt=\"\" width=\"220\" height=\"220\" /></td>\r\n<td style=\"width: 50%;\">\r\n<h4 class=\"a-spacing-mini\">Handcrafted</h4>\r\n<p class=\"a-size-small\">Jewelry is a form of expression; it is also an extension of yourself. With decades of experience 